INSERT INTO "Question__c" VALUES('Question__c-252','false','','','','Started App;Submitted App','','','','','false','','','','','6.0','false','true','Started App','false','SW_GR_MSW|MSWA','','','','','','false','','','','','GPA Requirements Accel (GSSW)','Name','false','','','','','','','','QuestionUuid-f26d3f43-fdd9-4d71-a60a-d36a9df6be18','','012DS00000AdtxdYAB','','','','','<p>If accepted, students must maintain the following in senior year:</p><p>- Cumulative GPA of 3.0</p><p>- Social Work GPA of 3.5</p><p>- Good academic and professional standing within the BSW program</p><p><br></p><p>Students will be asked to confirm their intent to enroll in the St. Thomas MSW program in the spring of their senior year.</p>','','','','Requirement_Item__c-125');
