INSERT INTO "Question__c" VALUES('Question__c-385','true','','','','','','','','','false','','','','','','false','true','','false','','','','','','','false','','','','','Link to UG Apps (UGTRDFC)','Name','false','','','','','','','','QuestionUuid-319b15ab-cd1a-403e-b161-acbae63b1a3c','','012DS00000AdtxdYAB','','','','','<p><strong style="font-size: 16px; color: rgb(81, 12, 118);">You are applying to the University of St. Thomas&#39; Bachelor&#39;s Degree Program as aDougherty Family College (DFC) guaranteed admission transitionapplicant.</strong></p><p></p><p>DFC students are guaranteed admission to the bachelors degree program at the University of St. Thomas if they meet the eligibility requirements listed below:</p><p><br></p><p><strong style="color: rgb(255, 108, 0);">Admissions Eligibility Requirements:</strong></p><ul><li>Must have a minimum cumulative DFC GPA of 2.50</li><li>Must have a satisfactory disciplinary record with the university</li><li>Must earn their Associate of Arts degree from the DFC the spring prior to enrolling in the bachelors degree program at the University of St. Thomas</li></ul><p></p><p><span style="color: rgb(68, 68, 68);">Click next to create your password and create your application.</span></p>','','','','Requirement_Item__c-482');
