INSERT INTO "Question__c" VALUES('Question__c-527','true','','','','','','','','','false','','','','','1.0','false','true','','false','','','','','','','false','','','','','Fieldwork Instructor Evaluation (GSSW)','Name','false','','','','','','','','QuestionUuid-1fc7c0fb-15e6-4940-a492-e6073058569d','','012DS00000AdtxdYAB','','','','','<p><strong style="color: rgb(107, 54, 150); font-size: 18px;">Fieldwork Instructor Evaluation - Advanced Standing Applicants</strong></p><p><br></p><p><span style="font-size: 11pt;">Advanced-standing applicants must submit a copy of the senior fieldwork evaluation from their undergraduate social work program.</span></p><p><br></p><p><span style="font-size: 11pt;">Applicants may submit a copy of the evaluation from their own records (if they retained the paperwork after graduation). </span></p><p><br></p><p><span style="font-size: 11pt;">Otherwise, applicants should contact the social work department at their undergraduate institution and request that a copy be sent to:</span></p><p><br></p><p><strong style="font-size: 11pt;"><em>University of St. Thomas</em></strong></p><p><strong style="font-size: 11pt;"><em>Graduate Records - Admissions</em></strong></p><p><strong style="font-size: 11pt;"><em>1000 LaSalle Ave., Box 5</em></strong></p><p><strong style="font-size: 11pt;"><em>Minneapolis, MN 55403-2005</em></strong></p><p><br></p><p><span style="font-size: 11pt;">OR Fieldwork evaluations can be emailed directly to the University of St. Thomas as a PDF to: </span><strong style="font-size: 14.6667px; background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);">gradadmissions@stthomas.edu</strong><span style="font-size: 11pt;">; Subject line: Field evaluation for MSW applicant [YOUR NAME]</span></p><p><br></p><p><span style="font-size: 11pt;">If the evaluation is no longer on file, the social work department should submit a brief letter of explanation. If your undergraduate institution sends you an email explaining that they no longer have your evaluation, you may forward this email to </span><strong style="font-size: 11pt;">gradadmissions@stthomas.edu</strong><span style="font-size: 11pt;"> as an acceptable explanation (Subject line: Field evaluation related to MSW applicant [YOUR NAME]). Students who have not yet completed their senior field placement may submit a copy of their junior fie</span><span style="font-size: 11pt; font-family: Calibri;">ldwork evaluation.</span></p>','','','','Requirement_Item__c-190');
