INSERT INTO "Question__c" VALUES('Question__c-564','true','','','','','','','','','false','','','','','23.0','false','true','','false','','','','','','','false','','','','','Static Instruct (GSSW)','Name','false','','','','','','','','QuestionUuid-b8b89188-d76f-4010-8683-b09fb4c801c2','','012DS00000AdtxdYAB','','','','','<p><br></p><p><span style="font-size: 14px;">Thanks for answering the questions above. Please attach a separate letter providing feedback regarding the applicant&#39;s academic, professional, and personal characteristics including:</span></p><p><br></p><ul><li><span style="font-size: 14px;">Circumstances in which you are familiar with the applicants work, and the nature of the work that they performed</span></li><li><span style="font-size: 14px;">Applicants ability and demonstration for self-reflection, engagement, empathy, and respect for others</span></li><li><span style="font-size: 14px;">Their engagement as a learner and preparation for graduate education (if applicable)</span></li><li><span style="font-size: 14px;">And personal, professional, or educational-related experiences that will prepare the applicant for advanced social work practice; demonstrated experiences and examples are encouraged as they will help in determining the applicants fit with our program.</span></li></ul><p>Your letter is a critical component in the individuals application package and will be used to help the admissions committee determine their fit with our MSW program and with the social work profession. We appreciate your sharing your experiences and impressions of this applicant with us.</p><p><br></p><p><br></p>','','','','Requirement_Item__c-159');
