INSERT INTO "Question__c" VALUES('Question__c-616','true','','','','Started App;Submitted App','','','','','false','Master''s','','','','1.0','false','true','Started App','false','','','','','','','false','','','','','Performance Assessment MA Static(GCAS)','Name','false','','','','','','','','QuestionUuid-bfc1ac0b-9f24-4af8-9927-de24d4db7b22','','012DS00000AdtxdYAB','','Started App','','','Performance Assessment Candidates for the Master of Arts degree must demonstrate music performance ability in piano, voice or other classical instrumental performance.<br><br>Applicants must submit a performance video of two (2) different compositions, showing contrasting styles, technical demands and tempi. The recording should include accompaniment if applicable.<br><br>In addition, all applicants should sing a simple, short (no more than 16 bars), unaccompanied melody of their choosing. The intention is to assess an applicant&#39;s ability to sing in-tune--we are not concerned with the vocal quality of instrumentalists.<br><br>Your performance(s) should be uploaded to YouTube as public links. You can either combine your performances into one video or break them into separate videos. The application will not be considered until the performance video link(s) have been provided.','Music Education','','','Requirement_Item__c-92');
INSERT INTO "Question__c" VALUES('Question__c-617','true','','','','Started App;Submitted App','','','','','false','Certificate','','','','1.0','false','true','Started App','false','','','','','','','false','','','','','Performance Assessment Cert Static(GCAS)','Name','false','','','','','','','','QuestionUuid-6fc5e3ba-c2bb-4b16-8c1f-cb359dd9a469','','012DS00000AdtxdYAB','','Started App','','','Performance Assessment Candidates for Graduate Certificates must demonstrate music performance ability in piano, voice or other classical instrumental performance.<br><br>Applicants must submit a performance video of two (2) different compositions, showing contrasting styles, technical demands and tempi. The recording should include accompaniment if applicable.<br><br>In addition, all applicants should sing a simple, short (no more than 16 bars), unaccompanied melody of their choosing. The intention is to assess an applicant&#39;s ability to sing in-tune--we are not concerned with the vocal quality of instrumentalists.<br><br>Your performance(s) should be uploaded to YouTube as public links. You can either combine your performances into one video or break them into separate videos. The application will not be considered until the performance video link(s) have been provided.','Music Education','','','Requirement_Item__c-92');
