INSERT INTO "Question__c" VALUES('Question__c-693','true','','','','Started App;Submitted App','','','','','false','Doctoral','','','','1.0','false','true','Started App','false','','','','','','','false','Scholarship Information','','','','Scholarship Information (GSSW)','Name','false','','','','','','','','QuestionUuid-48f8e308-e0c3-45a9-83c1-e59d833699c2','','012DS00000AdtxdYAB','','','','','<p><strong style="font-size: 16px; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);">Barbara W. Shank Scholarship</strong></p><p><br></p><p>Please indicate if you would like to be reviewed for the Barbara W. Shank scholarship based on the criteria outlined below.</p><p><br></p><p>Meet one or more of the following three criteria, with preference given to students who meet all criteria:</p><p><br></p><ul><li>Have experience living in a community with a majority North American Indigenous population.</li></ul><p><br></p><ul><li>Have a demonstrated knowledge of the history, culture or language of one or more North American Indigenous nations.</li></ul><p><br></p><ul><li>Have demonstrated experience in or commitment to working with North American Indigenous peoples.</li></ul>','','','','Requirement_Item__c-191');
