INSERT INTO "Question__c" VALUES('Question__c-730','false','','','','','','','','','false','Doctoral','','','','1.0','false','true','','false','','','','','','','false','Recommender Information Doctor Static (GSSW)','','','','Recommender Information Doctor Static (GSSW)','Name','false','','','','','','','','QuestionUuid-a9829071-8c65-4efc-8810-fc043abf0ad7','','012DS00000AdtxdYAB','','','','','<p>Three (3) letters of recommendation are required for this application. Please provide contact information below for individuals who can attest to your skills and experience.</p>','','','','Requirement_Item__c-181');
INSERT INTO "Question__c" VALUES('Question__c-731','false','','','','','','','','','false','Master''s','','','','1.0','false','true','','false','','','','','','','false','Recommender Information Static','','','','Recommender Information MS Static (GSSW)','Name','false','','','','','','','','QuestionUuid-3ac5baf5-a834-4fa5-987c-c07c013b9f3b','','012DS00000AdtxdYAB','','','','','<p>Three (3) letters of recommendation are required for the MSW application. Please provide contact information below for individuals who can attest to your skills and experience. MSW recommendation forms must be completed by individuals who can attest to applicant&#39;s readiness for graduate social work education, inlcuding:</p><p><br></p><p> Self-reflection, engagement, and respect for others</p><p> Engagement as a learner and preparation for graduate education</p><p> Previous related experiences - personal, professional, or educational - that would prepare the applicant for advanced social work practice</p><p><br></p><p>Only professional, community or academic references will be considered; personal references are not acceptable. References must complete both the checklist and the accompanying statement sections of the form. A link to the recommendation form will be sent when the recommendations section of the MSW application form has been completed. Please alert your references in advance to expect an email. These are confidential recommendations submitted directly from the references to the Office of Graduate Admissions; applicants who wish to view the recommendations are responsible for making the appropriate arrangements with their references.</p>','','','','Requirement_Item__c-181');
INSERT INTO "Question__c" VALUES('Question__c-732','false','','','','','','','','','false','Master''s','','','','1.0','false','true','','false','','','','','','','false','Recommender Information Static','','','','Recommender Information MS Static (GSSW)','Name','false','','','','','','','','QuestionUuid-38e26568-1c76-45f5-b7e6-c99c08fd3ab7','','012DS00000AdtxdYAB','','','','','<p>Two (2) letters of recommendation are required for the MSW application. Please provide contact information below for individuals who can attest to your skills and experience. MSW recommendation forms must be completed by individuals who can attest to applicant&#39;s readiness for graduate social work education, inlcuding:</p><p><br></p><p> Self-reflection, engagement, and respect for others</p><p> Engagement as a learner and preparation for graduate education</p><p> Previous related experiences - personal, professional, or educational - that would prepare the applicant for advanced social work practice</p><p><br></p><p>Only professional, community or academic references will be considered; personal references are not acceptable. References must complete both the checklist and the accompanying statement sections of the form. A link to the recommendation form will be sent when the recommendations section of the MSW application form has been completed. Please alert your references in advance to expect an email. These are confidential recommendations submitted directly from the references to the Office of Graduate Admissions; applicants who wish to view the recommendations are responsible for making the appropriate arrangements with their references.</p>','','','','Requirement_Item__c-182');
INSERT INTO "Question__c" VALUES('Question__c-733','true','','','','','','','','','false','Doctoral','','','','1.0','false','true','','false','','','','','','','false','Recommender Information Doctor Static (GSSW)','','','','Recommender Information Doctor Static (GSSW)','Name','false','','','','','','','','QuestionUuid-12ea4fd2-5b66-44ee-a450-bc8f922af3b8','','012DS00000AdtxdYAB','','','','','<p>Three (3) letters of recommendation are required for this application. Please provide contact information below for individuals who can attest to your skills and experience.</p>','','','','Requirement_Item__c-182');
