INSERT INTO "Question__c" VALUES('Question__c-739','true','','','','','','','','','false','','','','','5.0','false','true','','false','','','','','','','false','','','','','Non-Degree MSW Info (GSSW)','Name','false','','','','','','','','QuestionUuid-c3c1cba2-fe1c-4d1b-bdab-ed8401529bfc','','012DS00000AdtxdYAB','','','','','<p><span style="color: #000000;">In order to enroll in a Master of Social Work course as a <strong>non-degree student</strong></span><span style="color: #000000;">for credit, the following application is required. Once it is submitted and required transcripts are received, and if space is available, you will be registered. Confirmation of your enrollment, as well as information regarding campus maps, student services, where to buy books, parking permits and how to obtain a student ID card will be sent after you are registered in a course. An account will be assigned, which will allow access to the student information system at the University of St. Thomas where you can obtain class schedules, grades, and billing information via Murphy Online.</span></p>

<p></p>

<p><span style="color: #000000;">Please note, enrollment in non-degree courses is subject to space availability.</span></p>','','','','Requirement_Item__c-192');
