INSERT INTO "Question__c" VALUES('Question__c-1206','true','','','','Started App;Submitted App','','','','','false','','','Hide','','8.0','false','true','Started App','false','','','','','','','false','Do you plan to discern the priesthood by applying to the Saint John Vianney College Seminary?','','','','SJV Static static (UGTR)','Name','false','','','','','','','','QuestionUuid-343dade3-928b-4fb0-886e-bc243b1a758e','','012DS00000AdtxdYAB','','Started App','','','<p><span style="color: rgb(3, 45, 96);">Interested students should speak with their Diocesan vocation director as soon as possible. By selecting Yes to this question, you agree that the Office of Admissions may share certain information from your application with Saint John Vianney College Seminary to facilitate the dual application process.</span></p>','','','','Requirement_Item__c-724');
