INSERT INTO "Question__c" VALUES('Question__c-1208','true','','','','Started App;Submitted App','','','','','false','','','','','4.0','false','true','Started App','false','','','','','','','false','Are you a first generation college student?','','','','First Generation static (UGTR)','Name','false','','','','','','','','QuestionUuid-27d1603d-1019-4c0f-a2b6-a5f62b6c1845','','012DS00000AdtxdYAB','','Started App','','','<p><span style="font-size: 15.6px; color: rgb(3, 45, 96);">The term first-generation college student means either: (A) an individual both of whose parents did not complete a bachelor&#39;s degree; or (B) in the case of any individual who regularly resided with and received support from only one parent, an individual whose only such parent did not complete a bachelor&#39;s degree.</span></p>','','','','Requirement_Item__c-724');
INSERT INTO "Question__c" VALUES('Question__c-1209','true','','','','Started App;Submitted App','','U.S. Citizen;U.S. Dual Citizen;U.S. Permanent Resident;Asylee/Refugee;Other','','','false','','','','','2.0','false','true','Started App','false','','','','','','','false','Do you intend to pursue need-based financial aid?','','','','Need financial aid static (UGTR)','Name','false','','','','','','','','QuestionUuid-917ebdde-6327-476a-a77f-9971a972f5c2','','012DS00000AdtxdYAB','','Started App','','','<p><span style="background-color: #ffffff; color: #032d60;">To learn more about Undergraduate Financial Aid,</span><span style="background-color: #ffffff; color: #444444;"> </span><a href="https://www.stthomas.edu/admissions/undergraduate/financial-aid/" style="background-color: rgb(255, 255, 255);" target="_blank">click here</a>.</p>','','','','Requirement_Item__c-724');
INSERT INTO "Question__c" VALUES('Question__c-1210','true','','','','Started App;Submitted App','','','','','false','','','','','0.0','false','true','Started App','false','','','','','','','false','Do you intend to live on campus?','','','','On-campus housing static (UGTR)','Name','false','','','','','','','','QuestionUuid-181c1f8a-55f8-4d7f-aa91-25dd8871efd9','','012DS00000AdtxdYAB','','Started App','','','<p><span style="color: rgb(3, 45, 96); font-size: 15.6px;">St. Thomas has a two-year residency requirement policy that requires full-time, undergraduate, first and second-year students to live on campus. To learn more about this policy, including possible exceptions, </span><a href="https://www.stthomas.edu/residence-life/policies-resources/residency-requirement/index.html" target="_blank" style="color: rgb(1, 118, 211); font-size: 15.6px;">click here.</a></p><p><br></p><p><span style="color: rgb(3, 45, 96);">Transfer stud<span class="ql-cursor"></span>ents who enter with one semester completed at another college/university are required to complete the remaining three semesters of the residency requirement on campus with St. Thomas. Transfers having completed two or more semesters at another college/university are waived from the residency requirement.</span></p>','','','','Requirement_Item__c-724');
