INSERT INTO "Question__c" VALUES('Question__c-1216','true','','','','','','','','','false','','','','','22.0','false','true','','false','','','','','','','false','Application Experience Feedback','','','','Application Feedback Static (UGTR)','Name','false','','','','','','','','QuestionUuid-beb3eb75-1b8e-4403-89d8-c25f1d1acb7b','','012DS00000AdtxdYAB','','','','','<p><span style="color: rgb(3, 45, 96); font-size: 12.5pt; font-family: Calibri, sans-serif;">We are interested in hearing about your experience with our online application. We appreciate your feedback. Thank you.</span></p>','','','','Requirement_Item__c-724');
INSERT INTO "Question__c" VALUES('Question__c-1217','true','','','','','','','','','false','','','','','','false','true','','false','','','','','','','false','','','','','Deposit Confirming (UGFR)','Name','false','400.0','First_Year_Undergraduate_Deposit','Confirming Deposit','Custom Amount','','','','QuestionUuid-3e7f2160-f77e-4b85-abf7-b6e22811c71c','','012DS00000AdtxXYAR','','','','','','','','','Requirement_Item__c-469');
INSERT INTO "Question__c" VALUES('Question__c-1218','true','','','','','','','','','false','','','','','2.0','false','true','','false','','','','','','','false','','','','','Confirmation Deposit Enticement (UGFR)','Name','false','','','','','','','','QuestionUuid-f8172228-6a1e-4949-9151-cb1fab770af8','','012DS00000AdtxdYAB','','','','','<p><em>To reserve your place in the class and request your space in our residence halls you must submit a $400 confirming deposit.</em></p><p></p><p>Please note:</p><ul><li>Students admitted to St. Thomas are expected to abide by certain conduct and fulfill obligations. The complete details are<a href="https://www.stthomas.edu/_media-library/_documents/main/admissions-code-of-conduct.pdf" target="_blank">found here</a>.</li><li>The University of St. Thomas requires all students, faculty and staff to be<a href="https://www.stthomas.edu/center-for-well-being/health-requirements/covid-19-vaccine/index.html" target="_blank">vaccinated for COVID-19</a>. Limited exemptions are available for religious and medical reasons.</li></ul><p>International students depositing from outside the U.S.?</p><ul><li>If you are submitting your deposit from outside the U.S., please <a href="https://pay.flywire.com/?utm_source=www&amp;utm_medium=referral&amp;utm_campaign=redirectio" target="_blank">submit your deposit</a> through Flywire.com and choose the University of St. Thomas (Minnesota).</li></ul>','','','','Requirement_Item__c-469');
INSERT INTO "Question__c" VALUES('Question__c-1219','true','','','','','','','','','false','','','','','2.0','false','true','','false','','','','','','','false','','','','','Confirmation Deposit Received (UGFR)','Name','false','','','','','','','','QuestionUuid-3a0f3095-982d-4d1a-9502-74c828367091','','012DS00000AdtxdYAB','','','','','<p><strong style="font-size: 18px;">Deposit Received</strong></p><p><br></p><p>Thanks for submitting your deposit and congratulations on making your college decision. We&#39;re so happy you&#39;ve chosen St. Thomas!</p>','','','','Requirement_Item__c-469');
