INSERT INTO "Question__c" VALUES('Question__c-1303','true','','','','','','','','','false','','','','','','false','true','','false','','','','','','','false','','','','','Scholarships static (GSPP)','Name','false','','','','','','','','QuestionUuid-1d03f1fd-f3f6-4e55-9f6a-243816787d1b','','012DS00000AdtxdYAB','','','','','<p style="text-align: center;"><strong>Scholarships</strong></p>

<p></p>

<p>The first step to receiving financial aid is to complete a Free Application for Federal Student Aid (FAFSA). The FAFSA collects information required to determine whether you qualify for financial aid and how much you are eligible to receive.<a href="http://www.stthomas.edu/financialaid/graduate/" target="_blank">Click here</a>to visit Graduate Financial Services for details.</p>

<p></p>

<p>For scholarship information, please<a href="https://www.stthomas.edu/financialaid/graduate/scholarships/" target="_blank">click here</a>to visit our website for current scholarship information.</p>

<p></p>

<p>The University of St. Thomas offers several part-time assistantship and work-study positions that can supplement your education funding.<a href="https://stthomas.edu/jobs/" target="_blank">Click here</a>to see what is available.</p>','','','','Requirement_Item__c-111');
INSERT INTO "Question__c" VALUES('Question__c-1304','true','','','','','','','','','false','','','','','0.0','false','true','','false','','','','','','','false','','','','','Murray Institute Scholarship static (GSOEd)','Name','false','','','','','','','','QuestionUuid-88386f48-3717-429d-a68e-e52beb25a12b','','012DS00000AdtxdYAB','','Started App','','','<p style="text-align: center;"><strong style="color: rgb(109, 54, 150); font-size: 18px;">Murray Institute Scholarship</strong></p><p><br></p><p>The Murray Institute for Catholic Education is a collaboration between the University of St. Thomas and the Archdiocese of Saint Paul and Minneapolis. The Murray Institutes mission is to support and sustain the educational ministries of the Archdiocese by providing graduate education for benefits-eligible educators of Catholic schools and parishes within the Archdiocese of Saint Paul and Minneapolis.</p><p><br></p><p>The Murray Institute supports graduate education for Murray-approved degrees at University of St. Thomas.The Murray Institute also supports Non-Degree Seeking applicants who wish to enroll in University of St. Thomas individual graduate courses not within a specific degree program.</p><p><br></p><p><strong style="font-family: truenoregular, Arial, sans-serif;">Eligibility</strong></p><p>To be eligible for Murray Institute funding, applicants shall:</p><ul><li>Employed through the Archdiocese of St. Paul and Minneapolis in educational ministries<em>(no minimum years of service required)</em>.</li><li>Hold a B.A. or B.S. degree from an accredited academic institution.</li><li>Undergraduate cumulative grade point average (GPA) of 3.0 (on a 4.0 scale).</li><li>Submit ALL official transcript(s) of all academic work, both undergraduate, transfer credits and graduate, if applicable.</li><li>Submit2-3 letters of recommendation, depending on the program requirements, attesting to the applicant&#39;s ability to enter this program. (1) letter of recommendation must come from the applicants principal or pastor.</li><li>Commit to working within the Archdiocese of St. Paul and Minneapolis for the duration of the program and up to 3 years upon completion of the program.</li></ul><p><br></p>','','','','Requirement_Item__c-562');
