INSERT INTO "Question__c" VALUES('Question__c-1329','true','','','','Started App;Submitted App','','','','','false','','','','','42.0','false','true','Started App','false','','','','','','','false','','','','','English Proficiency Waivers (GSON)','Name','false','','','','','','','','QuestionUuid-bea1c160-6df1-44bd-8425-568103b1d3f1','','012DS00000AdtxdYAB','','','','','In addition to fulfilling admission requirements, applicants who do not have English as their native language* are required to provide proof of English proficiency from one of our approved English proficiency service providers. Score reports can be no more than two years old.<br><br>See specifics on <a href="https://www.stthomas.edu/admissions/graduate/international/index.html" target="_blank"><u>English proficiency exams, passing scores and ELS learning options</u></a>.<br><br><strong>*Proof of English proficiency is waived for the following students:</strong>
