INSERT INTO "Question__c" VALUES('Question__c-1365','true','','','','','','','','','false','Master''s;Certificate','','','','0.0','false','true','','false','','','','','','','false','','','','','Dean''s Scholarship Static(GCAS)','Name','false','','','','','','','','QuestionUuid-639052c4-43d6-4763-a3ba-db0adf30def9','','012DS00000AdtxdYAB','','','','','<p style="text-align: center;"><strong style="font-size: 20px; color: rgb(109, 54, 150);">Dean&#39;s Scholarship</strong></p><p><br></p><p><span style="font-size: 16px;">The College of Arts &amp; Sciences offers a limited number of competitive scholarships for students admitted into our graduate programs. Please check this box if you would like to be considered for this scholarship opportunity. Upon acceptance into the program, information about applying for the Deans Scholarship will be forwarded to you.<span class="ql-cursor"></span></span></p>','','','','Requirement_Item__c-358');
INSERT INTO "Question__c" VALUES('Question__c-1366','true','','','','Started App;Submitted App','','','','','false','','','','','','false','true','Started App','false','','','','','','','false','','','','','GPME Scholarship (GCAS)','Name','false','','','','','','','','QuestionUuid-42987ee2-80f5-43aa-95c7-db3231316a77','','012DS00000AdtxdYAB','','','','','<p><br></p><p><strong style="font-size: 20px; color: rgb(109, 54, 150);">Graduate Programs in Music Education Scholarship</strong></p><p><br></p><p><span style="font-size: 16px; color: rgb(0, 0, 0);">For Graduate Programs in Music Education scholarship information, please</span><a href="https://cas.stthomas.edu/departments/areas-of-study/music/" target="_blank" style="font-size: 16px; color: rgb(0, 0, 0);">click here</a><span style="font-size: 16px; color: rgb(0, 0, 0);">to visit our website. Completed applications are due on or before </span><strong style="font-size: 16px; color: rgb(0, 0, 0);">April 1</strong><span style="font-size: 16px; color: rgb(0, 0, 0);"> of the current year. Notifications will be processed by </span><strong style="font-size: 16px; color: rgb(0, 0, 0);">May 1</strong><span style="font-size: 16px; color: rgb(0, 0, 0);">.</span></p>','','','','Requirement_Item__c-378');
INSERT INTO "Question__c" VALUES('Question__c-1367','true','','','','Started App;Submitted App','','','','','false','','','','','','false','true','Started App','false','','','','','','','false','','','','','FAFSA (GCAS)','Name','false','','','','','','','','QuestionUuid-0d6e781b-c430-4d6a-9e37-0294ee0201ce','','012DS00000AdtxdYAB','','','','','<p><strong style="font-size: 20px; color: rgb(109, 54, 150);">FAFSA </strong></p><p><br></p><p><span style="color: rgb(0, 0, 0); font-size: 16px; background-color: rgb(255, 255, 255);">The first step to receiving financial aid is to complete a Free Application for Federal Student Aid (FAFSA). The FAFSA collects information required to determine whether you qualify for financial aid and how much you are eligible to receive.</span><a href="https://www.stthomas.edu/financialaid/graduate/" target="_blank" style="color: rgb(64, 156, 218); font-size: 16px; background-color: rgb(255, 255, 255);"><u>Click here</u></a><span style="color: rgb(0, 0, 0); font-size: 16px; background-color: rgb(255, 255, 255);"> to visit Graduate Financial Services for details.</span></p>','','','','Requirement_Item__c-378');
