INSERT INTO "Question__c" VALUES('Question__c-1453','true','','','','Started App;Submitted App','','','','','false','','','','','10.0','false','true','Started App','false','','','','','','','false','','','','','EOE Statement (UGTR)','Name','false','','','','','','','','QuestionUuid-e5771238-ac78-4ebb-9f6e-7bf865145ce9','','012DS00000AdtxdYAB','','','','','<p><br></p><p><br></p><p><strong style="color: rgb(81, 35, 115);">The University of St. Thomas is an equal opportunity educator and employer. St. Thomas does not unlawfully discriminate, in any of its programs or activities, on the basis of race, color, creed, religion, national origin, sex, sexual orientation, family status, disability, age, marital status, status with regard to public assistance, membership or activity in a local commission, genetic information or any other characteristic protected by applicable law. </strong><a href="http://www.stthomas.edu/eostatement" target="_blank"><strong>http://www.stthomas.edu/eostatement</strong></a></p><p><br></p><p><strong style="color: rgb(81, 35, 115);">The University of St. Thomas is registered with the Minnesota Office of Higher Education pursuant to sections 136A.61 to 136A.71. Registration is not an endorsement of the institution. Credits earned at the institution may not transfer to all other institutions. Contact information for the Minnesota Office of Higher Education is: 1450 Energy Park Drive, Suite 350 St. Paul, MN 55108-5227 Phone: (651) 642-0567 Toll Free: (800) 657-3866 Fax: (651) 642-0675 </strong><a href="https://www.ohe.state.mn.us/" target="_blank"><strong>https://www.ohe.state.mn.us/</strong></a></p>','','','','Requirement_Item__c-836');
INSERT INTO "Question__c" VALUES('Question__c-1454','true','','','','Started App;Submitted App','','','','','false','','','','','6.0','true','true','Started App','false','','','Apply Without Standardized Test','','','','false','','','','','Test Optional Consent (UGTR)','Name','false','','','','','I Agree','','','QuestionUuid-c52c6611-9aab-4a5f-87a0-3d2b712521e3','','012DS00000AdtxaYAB','','Started App','','','','','','','Requirement_Item__c-836');
INSERT INTO "Question__c" VALUES('Question__c-1455','true','','','','Started App;Submitted App','','','','','false','','','','','5.0','false','true','Started App','false','','','Apply Without Standardized Test','','','','false','','','','','Test Optional Consent Text (UGTR)','Name','false','','','','','','','','QuestionUuid-c4a7c41a-08da-41bd-818f-9c0801fda8ae','','012DS00000AdtxdYAB','','Started App','','','<p><br></p><p>I have chosen to apply as a test-optional applicant. By doing so, I understand that my standardized test scores (even if submitted) will not be considered as part of the admission or merit scholarship review process. I agree to the information the University of St. Thomas has shared about its test optional policy. I understand that if I change my mind and wish to have my test reviewed with my application, I should contact my admissions counselor to discuss my options. <span style="color: rgb(255, 0, 0);">*</span></p>','','','','Requirement_Item__c-836');
INSERT INTO "Question__c" VALUES('Question__c-1456','true','','','','Started App;Submitted App','','','','','false','','','','','3.0','false','true','Started App','false','','','','','','','false','','','','','Application Changes Consent Text (UGTR)','Name','false','','','','','','','','QuestionUuid-bc575fae-73f4-4d73-bec4-7bb8725c90d4','','012DS00000AdtxdYAB','','','','','<p><br></p><p>I understand that once my application has been submitted it may not be altered; I will need to contact the Office of Undergraduate Admissions via email at <strong>admissions@stthomas.edu</strong> to provide additional information or make changes (ex. address change). <span style="color: rgb(255, 0, 0);">*</span></p>','','','','Requirement_Item__c-836');
INSERT INTO "Question__c" VALUES('Question__c-1457','true','','','','Started App;Submitted App','','','','','false','','','','','2.0','false','true','Started App','false','','','','','','','false','','','','','Application Materials Consent (UGTR)','Name','false','','','','','I Agree','','','QuestionUuid-555723aa-26a8-4ac2-9184-6eb46e073213','','012DS00000AdtxaYAB','','Started App','','','','','','','Requirement_Item__c-836');
INSERT INTO "Question__c" VALUES('Question__c-1458','true','','','','Started App;Submitted App','','','','','false','','','','','1.0','false','true','Started App','false','','','','','','','false','','','','','Application Materials Consent Text (UGTR)','Name','false','','','','','','','','QuestionUuid-0129860a-1781-4a9d-981c-a21d50aa4870','','012DS00000AdtxdYAB','','','','','<p><br></p><p>I have reviewed each page of my application; I certify the information I have provided on this application and all other admission materials is complete, accurate and true to the best of my knowledge. <span style="color: rgb(255, 0, 0);">*</span></p>','','','','Requirement_Item__c-836');
INSERT INTO "Question__c" VALUES('Question__c-1459','true','','','','','','','','','false','','','','','','false','true','','false','','','','','','','false','','','','','Message','Name','false','','','','','','','','QuestionUuid-8d82a4ec-8bcd-482d-846b-e70a26c06210','','012DS00000AdtxdYAB','','','','','<p><span style="font-size: 11pt;"><span><span style="font-family: Calibri,sans-serif;"><strong><span style="font-size: 12.5pt;"><span><span><span style="color: #461e64;">If you chose &quot;Apply with Standardized Test&quot;, you will be directed to self-report your scores on the next page. Otherwise, you will be directed to the &quot;Major/Area of Interest&quot; section.</span></span></span></span></strong></span></span></span></p>','','','','Requirement_Item__c-384');
INSERT INTO "Question__c" VALUES('Question__c-1460','true','','','','Submitted App','','','','','false','','','','','1.0','false','true','','false','','','','','','','false','Code of Conduct Form','','','','Dean of Students Form (UGTR)','Name','false','','','','','','','','QuestionUuid-3add1820-d574-47b5-8fb4-1c38d36bf65b','','012DS00000AdtxdYAB','','Submitted App','','','<p>To find out more information about the <em>required</em> Code of Conduct form, please visit the <a href="https://www.stthomas.edu/admissions/undergraduate/transfer/apply/" target="_blank">St. Thomas Transfer Admissions website.</a></p>','','','','Requirement_Item__c-117');
INSERT INTO "Question__c" VALUES('Question__c-1461','true','','','','Started App;Submitted App','','','','','false','','','','','1.0','false','true','Started App','false','','','','','','','false','','','','','Environmental Justice & Planetary Health Scholarship (GSSW))','Name','false','','','','','','','','QuestionUuid-16d64e9a-5a37-48b5-b1c9-b76b3f49ecda','','012DS00000AdtxdYAB','','','','','<p><strong style="color: rgb(0, 0, 0); font-size: 16px;">Environmental Justice &amp; Planetary Health Scholarship</strong></p><p><br></p><p><span style="color: rgb(10, 10, 10); font-size: 16.32px;">Please indicate if you would like to be reviewed for the Environmental Justice &amp; Planetary Health scholarship based on the criteria outlined below.</span></p><p><br></p><p><span style="font-size: 16px;">This grant will support students whose dissertation will focus on environmental justice and/or planetary health topics that intersect with social work education, or program/curriculum development or practice at any system level. This can include but is not limited to: environmental racism, Indigenous environmental practices or ways of knowing (sustainable communities, addressing Solastalgia, connection to the land), access to natural resources needed for survival, or other related environmental justice issues in which some communities are disproportionately impacted by environmental policy, degradation, hazards, or disasters.</span></p>','','','','Requirement_Item__c-188');
