INSERT INTO "Question__c" VALUES('Question__c-1550','true','','','','Started App','','','','','false','','','','','1.0','false','true','Started App','false','','','','','','','false','Prerequisite Information','','','','Prerequisite Information (GSON)','Name','false','','','','','','','','QuestionUuid-c73e831d-75ba-46d7-b0de-3d8361648dc5','','012DS00000AdtxdYAB','','','','','All MSN applicants are required to have the following courses completed before they begin MSN classes. Please indicate if you&#39;ve taken or are currently taking the following courses. If you are unsure, please email nursing@stthomas.edu.<br><br>Theminimum grade of an individual prerequisite must be a C- (1.7) or higher.Our minimum GPA for admission is based on the average GPA of all six prerequisite courses. To apply for this program you must have a3.0-grade point average for the six courses listed in the text boxes below. Meaning you may have earned a C in one course but several A or B scores in the other courses, bringing your prerequisite grade point average above a 3.0.','','','','Requirement_Item__c-324');
