INSERT INTO "Question__c" VALUES('Question__c-1588','true','','','','Started App;Submitted App','','','','','false','','','','','4.0','false','true','Started App','false','','','','','','','false','','','','','Application Changes Consent Text (GSON)','Name','false','','','','','','','','QuestionUuid-c3fb7604-9781-4664-b6f2-ef13d07cf250','','012DS00000AdtxdYAB','','Started App','','','<p><br></p><p>I understand that once my application has been submitted it may not be altered; I will need to contact the Office of Graduate Admissions via email at <a href="mailto:gradadmissions@stthomas.edu" target="_blank">gradadmissions@stthomas.edu</a> to provide additional information or make changes (ex. address change). <span style="color: rgb(255, 0, 0); background-color: rgb(255, 255, 255);">*</span></p>','','','','Requirement_Item__c-330');
INSERT INTO "Question__c" VALUES('Question__c-1589','true','','','','','','','','','false','','','','','','false','true','','false','','','','','','','false','','','','','Scholarships','Name','false','','','','','','','','QuestionUuid-bb42d3d6-43f7-4242-8e9f-e5d5bfaf73c7','','012DS00000AdtxdYAB','','','','','The first step to receiving financial aid is to complete a Free Application for Federal Student Aid (FAFSA). The FAFSA collects information required to determine whether you qualify for financial aid and how much you are eligible to receive. <a href="https://www.stthomas.edu/financialaid/graduate/" target="_blank">Click here</a>to visit Graduate Financial Services for details.<br><br>Please <a href="https://education.stthomas.edu/admissions/graduate/index.html" target="_blank">click here</a>to visit our website for current scholarship information.<br><br>The School of Education offers several part-time assistantship and work-study positions that can supplement your education funding. <a href="https://studentemployment-stthomas.icims.com/jobs/intro" target="_blank">Click here</a> to see what is available.','','','','Requirement_Item__c-563');
