INSERT INTO "Question__c" VALUES('Question__c-1619','true','','','','Started App;Submitted App','','','','','false','','','','','1.0','false','true','Started App','false','','','','','','','false','','','','','Course Interests ME ND Static(GCAS)','Name','false','','','','','','','','QuestionUuid-0ab517a1-03a1-49d5-a0d1-807b9e7f757c','','012DS00000AdtxdYAB','','','','','<p><strong style="font-size: 16px; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);">PLEASE NOTE: You cannot be registered for courses until your finished application has been submitted.</strong></p><p><br></p><p>All Performance Studies registrations MUST include instructor name AND length of study (30 minutes or 50 minutes) or registration will not be processed.</p><p><br></p><p>Available courses can be found here in our <a href="https://look.stthomas.edu/view/883936736/https://look.stthomas.edu/view/883936736/" target="_blank">Course Catalog Lookbook</a>.</p>','','','','Requirement_Item__c-355');
INSERT INTO "Question__c" VALUES('Question__c-1620','true','','','','','','','','','false','','','','','2.0','false','true','','false','','','','','','Example: GMUS 731, Orff Schulwerk Levels I, 3 credits, Non-Degree','false','Please use the following formula and example to list your selected course(s). Course Number and Section, Course Title, Number of Credits, Non-Degree/Audit. Please start a new line for each course.','','','','Course Interests ME ND(GCAS)','Name','false','','','','','','','','QuestionUuid-45c5951a-0198-471f-9105-c939078026ea','','012DS00000AdtxUYAR','','Started App','','','','','','','Requirement_Item__c-355');
INSERT INTO "Question__c" VALUES('Question__c-1621','true','','','','','','','','','false','','','','','3.0','false','true','','false','','','','','','','false','','','','','Course Interests ND Audit (GCAS)','Name','false','','','','','','','','QuestionUuid-8c94d2b9-9867-4064-838a-97fa9dad8661','','012DS00000AdtxdYAB','','','','','<p><br></p><p>Non-Degree: The option may be of interest to students with a desire to pursue graduate study but not necessarily in obtaining a degree. Enrolling in one or more courses at the non-degree status will provide contact with faculty members and an opportunity to evaluate whether the programs offerings match a students needs, interests, and abilities. Up to six credits taken as a non-degree student may be applied for credit towards the degree.</p><p><br></p><p>Audit: 2- or 3-credit courses may be audited. Auditors pay reduced tuition rates based on a percentage formula. If a student audits a class, they cannot receive graduate credit. Students who audit Kodly or Orff Schulwerk are still eligible to receive the certificate if they audit the courses.</p><p>Visit<a href="https://www.stthomas.edu/businessoffice" target="_blank">https://www.stthomas.edu/businessoffice</a>to learn more.</p><p><br></p><p><strong style="font-size: 16px; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);">PLEASE NOTE: You cannot be registered for courses until your finished application has been submitted.</strong></p>','','','','Requirement_Item__c-355');
