INSERT INTO "Question__c" VALUES('Question__c-1712','true','','','','Started App;Submitted App','','','','','false','','','','','1.0','false','true','Started App','false','','','','','','','false','','','','','Additional Information to Review MADL Static (GCAS)','Name','false','','','','','','','','QuestionUuid-70977e5e-1082-4795-a9c3-ebb93c82daf6','','012DS00000AdtxdYAB','','','','','<p><span style="font-size: medium; font-family: Calibri, Arial, Helvetica, sans-serif; color: rgb(0, 0, 0);">If you feel it would be pertinent to your application, please take this opportunity to contextualize your academic journey. If undergraduate grades do not reflect your academic preparedness provide us with any details or explanations that will help the reviewers accurately understand your previous academic performance and experiences. Additionally, you could address what support systems you have in place to help you succeed in your graduate studies.</span></p>','','','','Requirement_Item__c-54');
