INSERT INTO "Question__c" VALUES('Question__c-1715','true','','','','Started App;Submitted App','','','','','false','','','','','3.0','false','true','Started App','false','','','','','','','false','','','','','Application Changes Consent Text (DFC)','Name','false','','','','','','','','QuestionUuid-5b6c296c-e6e4-4be9-8c0e-3b042f240cc1','','012DS00000AdtxdYAB','','Started App','','','<p><br></p><p><span style="font-size: 15.6px; color: rgb(0, 0, 0);">I understand that once my application has been submitted it may not be altered; I will need to contact the Office of Undergraduate Admissions via email at </span><strong style="font-size: 15.6px; color: rgb(0, 0, 0);">admissions@stthomas.edu</strong><span style="font-size: 15.6px; color: rgb(0, 0, 0);"> to provide additional information or make changes (ex. address change). </span><span style="color: rgb(255, 0, 0); background-color: rgb(255, 255, 255);">*</span></p>','','','','Requirement_Item__c-9');
