INSERT INTO "Question__c" VALUES('Question__c-1725','false','','','','Started App;Submitted App','','','','','false','','','','','0.0','false','true','Started App','false','','','','','','','false','The current application is to the Dougherty Family College.','','','','DFC Confirmation (DFC)','Name','true','','','','','','','','QuestionUuid-31c140d5-e46e-4385-b008-a6340c6d86ab','','012DS00000AdtxdYAB','','','','','<p><span style="color: #032d60;">I recognize that the Dougherty Family College is a selective, 2-year college designed to create a supportive pathway to a 4-year (bachelor&#39;s) degree for students with high financial need.</span></p>

<p></p>

<p><span style="color: #032d60;">I understand that an offer of admission may be conditioned on my ability to demonstrate financial need.</span></p>

<p></p>

<p><span style="color: #032d60;">I understand that the Dougherty Family College is designated for first-time students and certify that I have not taken any college courses since graduating from high school or have not been enrolled in any college or university since graduating from high school.</span></p>','','','','Requirement_Item__c-24');
