INSERT INTO "Question__c" VALUES('Question__c-1731','true','','','','','','','','','false','','','','','10.0','false','true','','false','','','','','','','false','Are you a first-generation college student?','','','','First Gen Static','Name','false','','','','','','','','QuestionUuid-c2801f57-894f-49a1-b443-f50ec697a63a','','012DS00000AdtxdYAB','','Started App','','','<p><span style="font-size: 16px; color: rgb(0, 0, 0);">The term &quot;first-generation college student&quot; means either: (A) an individual both of whose parents did not complete a bachelor&#39;s degree; or (B) in the case of any individual who regularly resided with and received support from only one parent, an individual whose only such parent did not complete a bachelor&#39;s degree.</span></p>','','','','Requirement_Item__c-24');
