INSERT INTO "Question__c" VALUES('Question__c-1959','true','','','','Started App;Submitted App','','','','','false','','','','','3.0','false','true','Started App','false','','','','','','','false','','','','','Application Changes Consent Text (UGTRDFC)','Name','false','','','','','','','','QuestionUuid-3a81d847-a729-4837-8cda-9e010d36be51','','012DS00000AdtxdYAB','','Started App','','','<p><br></p><p><span style="font-size: 15.6px; color: rgb(0, 0, 0);">I understand that once my application has been submitted it may not be altered; I will need to contact the Office of Undergraduate Admissions via email at </span><strong style="font-size: 15.6px; color: rgb(0, 0, 0);">admissions@stthomas.edu</strong><span style="font-size: 15.6px; color: rgb(0, 0, 0);"> to provide additional information or make changes (ex. address change). </span><span style="color: rgb(255, 0, 0); background-color: rgb(255, 255, 255);">*</span></p>','','','','Requirement_Item__c-487');
