INSERT INTO "Question__c" VALUES('Question__c-1961','true','','','','Started App;Submitted App','','','','','false','','','','','1.0','false','true','Started App','false','','','','','','','false','','','','','Application Materials Consent Text (UGTRDFC)','Name','false','','','','','','','','QuestionUuid-7e16c0f9-455a-4406-8ee9-e49183364747','','012DS00000AdtxdYAB','','Started App','','','<p><br></p><p>I have reviewed each page of my application; I certify the information I have provided on this application and all other admission materials is complete, accurate and true to the best of my knowledge. <span style="color: rgb(255, 0, 0);">*</span></p>','','','','Requirement_Item__c-487');
INSERT INTO "Question__c" VALUES('Question__c-1962','true','','','','Started App;Submitted App','','','','','false','','','','','10.0','false','true','Started App','false','','','','','','','false','','','','','EOE Statement (UGTRDFC)','Name','false','','','','','','','','QuestionUuid-ac9debac-a014-420a-883d-39b08d82e20f','','012DS00000AdtxdYAB','','','','','<p><br></p><p><br></p><p><strong style="color: rgb(81, 35, 115);">The University of St. Thomas is an equal opportunity educator and employer. St. Thomas does not unlawfully discriminate, in any of its programs or activities, on the basis of race, color, creed, religion, national origin, sex, sexual orientation, family status, disability, age, marital status, status with regard to public assistance, membership or activity in a local commission, genetic information or any other characteristic protected by applicable law. </strong><a href="http://www.stthomas.edu/eostatement" target="_blank"><strong>http://www.stthomas.edu/eostatement</strong></a></p><p><br></p><p><strong style="color: rgb(81, 35, 115);">The University of St. Thomas is registered with the Minnesota Office of Higher Education pursuant to sections 136A.61 to 136A.71. Registration is not an endorsement of the institution. Credits earned at the institution may not transfer to all other institutions. Contact information for the Minnesota Office of Higher Education is: 1450 Energy Park Drive, Suite 350 St. Paul, MN 55108-5227 Phone: (651) 642-0567 Toll Free: (800) 657-3866 Fax: (651) 642-0675 </strong><a href="https://www.ohe.state.mn.us/" target="_blank"><strong>https://www.ohe.state.mn.us/</strong></a></p>','','','','Requirement_Item__c-487');
