INSERT INTO "Question__c" VALUES('Question__c-2039','true','','','','Started App;Submitted App','','','','','false','','','','','1.0','false','true','Started App','false','','','','','','','false','','','','','Test Scores: All (GOCB)','Name','false','','','','','','','','QuestionUuid-ea1e462e-776b-4e3f-a1a8-266d8b9316ec','','012DS00000AdtxdYAB','','','','','<p><span style="font-size: 16px; color: rgb(10, 10, 10);">Please complete the information below to confirm whether you meet our criteria to waive any testing requirements. Applicants not meeting our requirements must complete a quantitative prep course, MBA Math.</span></p><p><br></p><p><span style="font-size: 16px;">No additional demonstration of skills and proficiency or testing will be required if you meet the following criteria:</span></p><ol><li><span style="font-size: 16px;">You have completed a Masters level degree or higher </span><strong style="font-size: 16px;">or</strong></li><li><span style="font-size: 16px;">You have a cumulative GPA above 3.0 with strong performance in quantitative coursework </span><strong style="font-size: 16px;">or</strong></li><li><span style="font-size: 16px;">You have a STEM/quantitative degree (Science, Technology, Engineering, Mathematics) with cumulative GPA above 2.8</span></li></ol><p><span style="font-size: 16px;">Applicants not meeting the above criteria still may be approved for a waiver of the prep course through our waiver process. Please connect 1:1 with your admissions representative to determine your requirements.</span></p>','','','','Requirement_Item__c-400');
