INSERT INTO "Question__c" VALUES('Question__c-2292','true','','','','','','','','','false','','','','','','false','true','','false','','','','','','','false','','','','','Link to UG Apps (UGFR)','Name','false','','','','','','','','QuestionUuid-19742fb4-e867-4f8c-bcff-018418a69fc7','','012DS00000AdtxdYAB','','','','','<p><span style="font-size: 16px;">You are applying to the University of St. Thomas as an </span><strong style="font-size: 16px;">Undergraduate First-Year </strong><span style="font-size: 16px;">applicant.</span></p><p><span style="font-size: 16px;"></span></p><p><em style="font-size: 16px;">If you have enrolled in college/university courses after completing high school (or earning your GED), you should apply as a transfer student. Click here to go to the </em><a href="https://www.stthomas.edu/application/index.html" target="_blank" style="font-size: 16px;"><em>Undergraduate Transfer application</em></a><span style="font-size: 16px;">.</span></p><p><span style="font-size: 16px;"></span></p><p><a href="https://dfc.stthomas.edu/about/index.html" target="_blank" style="font-size: 16px;"><em>Dougherty Family College</em></a><em style="font-size: 16px;"> offers a two-year associate degree designed to propel students towards success and provide a smooth transition to a four-year college. Click here if you would like to apply to the </em><a href="https://www.stthomas.edu/application/index.html" target="_blank" style="font-size: 16px;"><em>Dougherty Family College application</em></a><span style="font-size: 16px;">.</span></p><p><span style="font-size: 16px;"></span></p><p><span style="background-color: rgb(255, 255, 255); color: rgb(68, 68, 68); font-size: 16px;">Click next to create your password and create your application.</span></p>','','','','Requirement_Item__c-669');
