INSERT INTO "Question__c" VALUES('Question__c-2333','true','','','','Started App;Submitted App','','','','','false','','','','','4.0','false','true','Started App','false','','','','','','','false','Have you ever been adjudicated guilty or convicted of a misdemeanor or felony?','','','','Criminal Adjudication Text (UGTRDFC)','Name','false','','','','','','','','QuestionUuid-26d020ac-7886-44a5-a160-098ddb60a5e3','','012DS00000AdtxdYAB','','Started App','','','<p><span style="color: #032d60; font-family: truenolight,Arial,sans-serif; font-size: 15.2px;">Note that you are not required to answer &quot;yes&quot; to this question, or provide an explanation, if the criminal adjudication or conviction has been expunged, sealed, annulled, pardoned, destroyed, erased, impounded, or otherwise required by law or ordered by a court to be kept confidential.</span></p>','','','','Requirement_Item__c-497');
INSERT INTO "Question__c" VALUES('Question__c-2334','true','','','Disciplinary_Date__c','Started App;Submitted App','','','','','false','','','','','3.0','false','true','Started App','false','','','','','','','false','Please give the approximate date(s) of each incident, explain the circumstances and reflect on what you learned from the experience.','','','','Disciplinary Violation Dates (UGTRDFC)','Name','false','','','','','','','','QuestionUuid-e6607a67-981c-4d02-ab44-257b30ed5338','','012DS00000AdtxUYAR','','Started App','','','','','','','Requirement_Item__c-497');
INSERT INTO "Question__c" VALUES('Question__c-2335','true','','','','','','','','','false','','','','','1.0','false','true','','false','DV_GR_CER|CASL;DV_PS_MA|MAPL;DV_TH_MA|MTHL','','','','','','false','','','','','Transcript Requirements (SPSSD)','Name','false','','','','','','','','QuestionUuid-d10f392d-7bff-4046-8c0c-788e6117f22f','','012DS00000AdtxdYAB','','','','','<p style="text-align: center;"><strong style="font-size: 20px; color: rgb(109, 54, 150);">Please read before continuing</strong></p><p><br></p><p>Official transcripts (electronic or paper) are required from all institutions at which you earned post-secondary school credits<strong>*</strong></p><ul><li>Officialelectronic transcripts must be sentdirectly by the issuinginstitutions registrars officeto Graduate Admissions (<a href="mailto:gradadmissions@stthomas.edu" target="_blank">gradadmissions@stthomas.edu</a>) via a digital credential agency such as Parchment or National Student Clearinghouse.</li><li>Official paper transcripts must be signed by the appropriate university official and mailed in sealed envelopes to:</li></ul><p><br></p><p><strong><em>University of St. Thomas </em></strong></p><p><strong><em>Graduate Records  Admissions </em></strong></p><p><strong><em>1000 LaSalle Ave, Box 5 </em></strong></p><p><strong><em>Minneapolis, MN 55403-2005</em></strong><em> </em></p><p><br></p><p><strong>*Official transcripts are not required for: </strong></p><ul><li>College credits earned while attending high school</li><li>Study abroad transfer credits, and/or</li><li>Coursework or degrees that require a transcript evaluation.</li></ul><p><br></p><p>Applicants who completed post-secondary school credits at an institution originating outside the United States must obtain a transcript evaluation<strong>** </strong>from an approved transcript evaluation service<strong>***</strong>. Transcript evaluations must be delivered directly by the evaluation service to Graduate Admissions (<a href="mailto:gradadmissions@stthomas.edu" target="_blank">gradadmissions@stthomas.edu</a>or to the address above) and include the following:</p><ul><li>A statement that the evaluation report was based on original and/or authenticated educational documents,</li><li>A statement of U.S. equivalence of a baccalaureate degree from aninstitution that has institutional (formerly called regional) academic accreditation, and</li><li>A course-by-course analysis that includes grades and GPA calculated on a 4.0 scale.</li></ul><p><br></p><p><strong>**Transcript evaluations are not required for applicants who have: </strong></p><ul><li>A degree issued by an international institution AND a degree issued by an accredited U.S. institution, where the degree from the U.S. institution is at a higher level than the international degree, and/or</li><li>A primary degree issued by an accredited U.S. institution that contains<u>less</u>than 60 transferred credits from an international institution. In both cases, such applicants need only provide official transcripts from the international institution(s) and the U.S. institution(s). NOTE: A transcript evaluation<u>is</u>required for applicants who have a primary degree issued by an accredited U.S. institution that contains<u>more</u>than 60 transferred credits from an international institution.</li></ul><p><br></p><p><strong><em>*** We accept transcript evaluations from</em></strong><a href="https://nam02.safelinks.protection.outlook.com/?url=http%3A%2F%2Fwww.wes.org%2F&amp;data=04%7C01%7Cryanna.jackson%40stthomas.edu%7C1667856a96d041693c4408d9faf1a10e%7Ca081ff79318c45ec95f338ebc2801472%7C1%7C0%7C637816737983755844%7CUnknown%7CTWFpbGZsb3d8eyJWIjoiMC4wLjAwMDAiLCJQIjoiV2luMzIiLCJBTiI6Ik1haWwiLCJXVCI6Mn0%3D%7C3000&amp;sdata=rcaxorBqqHCF%2BDPstDksYX9fhrhlpjgKgnfM4TL1RYI%3D&amp;reserved=0" target="_blank"><strong><em>WES</em></strong></a><strong><em>and</em></strong><a href="https://nam02.safelinks.protection.outlook.com/?url=http%3A%2F%2Fwww.ece.org%2F&amp;data=04%7C01%7Cryanna.jackson%40stthomas.edu%7C1667856a96d041693c4408d9faf1a10e%7Ca081ff79318c45ec95f338ebc2801472%7C1%7C0%7C637816737983755844%7CUnknown%7CTWFpbGZsb3d8eyJWIjoiMC4wLjAwMDAiLCJQIjoiV2luMzIiLCJBTiI6Ik1haWwiLCJXVCI6Mn0%3D%7C3000&amp;sdata=Z2fSp46%2BWkjOZ6NYvd8Ln4XJT8tUao9z9r9xWPulkRU%3D&amp;reserved=0" target="_blank"><strong><em>ECE</em></strong></a><strong><em>. Please work with one of these services to obtain your evaluation. Its recommended that applicants request transcript evaluations at least six months prior to the start of the term in which they wish to start the program.</em></strong></p>','','','','Requirement_Item__c-602');
INSERT INTO "Question__c" VALUES('Question__c-2336','true','','','','','','','','','false','','','','','1.0','false','true','','false','DV_GR_NDO|NDND','','','','','','false','','','','','Transcript Requirements Non Degree (SPSSD)','Name','false','','','','','','','','QuestionUuid-54ba1628-55a7-4ec8-a584-82a3b62d144b','','012DS00000AdtxdYAB','','','','','<p style="text-align: center;"><strong style="color: rgb(109, 54, 150); font-size: 20px;">Please read before continuing</strong></p><p><br></p><p>Official transcripts (electronic or paper) are required from at least one of the institutions at which you earned post-secondary school credits<strong>*</strong></p><ul><li>Officialelectronic transcripts must be sentdirectly by the issuinginstitutions registrars officeto Graduate Admissions (<a href="mailto:gradadmissions@stthomas.edu" target="_blank">gradadmissions@stthomas.edu</a>) via a digital credential agency such as Parchment or National Student Clearinghouse.</li><li>Official paper transcripts must be signed by the appropriate university official and mailed in sealed envelopes to:</li></ul><p><br></p><p><strong><em>University of St. Thomas </em></strong></p><p><strong><em>Graduate Records  Admissions </em></strong></p><p><strong><em>1000 LaSalle Ave, Box 5 </em></strong></p><p><strong><em>Minneapolis, MN 55403-2005</em></strong><em> </em></p><p><br></p><p><strong>*Official transcripts are not required for: </strong></p><ul><li>College credits earned while attending high school</li><li>Study abroad transfer credits, and/or</li><li>Coursework or degrees that require a transcript evaluation.</li></ul><p><br></p><p>Applicants who completed post-secondary school credits at an institution originating outside the United States must obtain a transcript evaluation<strong>** </strong>from an approved transcript evaluation service<strong>***</strong>. Transcript evaluations must be delivered directly by the evaluation service to Graduate Admissions (<a href="mailto:gradadmissions@stthomas.edu" target="_blank">gradadmissions@stthomas.edu</a>or to the address above) and include the following:</p><ul><li>A statement that the evaluation report was based on original and/or authenticated educational documents,</li><li>A statement of U.S. equivalence of a baccalaureate degree from aninstitution that has institutional (formerly called regional) academic accreditation, and</li><li>A course-by-course analysis that includes grades and GPA calculated on a 4.0 scale.</li></ul><p><br></p><p><strong>**Transcript evaluations are not required for applicants who have: </strong></p><ul><li>A degree issued by an international institution AND a degree issued by an accredited U.S. institution, where the degree from the U.S. institution is at a higher level than the international degree, and/or</li><li>A primary degree issued by an accredited U.S. institution that contains<u>less</u>than 60 transferred credits from an international institution. In both cases, such applicants need only provide official transcripts from the international institution(s) and the U.S. institution(s). NOTE: A transcript evaluation<u>is</u>required for applicants who have a primary degree issued by an accredited U.S. institution that contains<u>more</u>than 60 transferred credits from an international institution.</li></ul><p><br></p><p><strong><em>*** We accept transcript evaluations from</em></strong><a href="https://nam02.safelinks.protection.outlook.com/?url=http%3A%2F%2Fwww.wes.org%2F&amp;data=04%7C01%7Cryanna.jackson%40stthomas.edu%7C1667856a96d041693c4408d9faf1a10e%7Ca081ff79318c45ec95f338ebc2801472%7C1%7C0%7C637816737983755844%7CUnknown%7CTWFpbGZsb3d8eyJWIjoiMC4wLjAwMDAiLCJQIjoiV2luMzIiLCJBTiI6Ik1haWwiLCJXVCI6Mn0%3D%7C3000&amp;sdata=rcaxorBqqHCF%2BDPstDksYX9fhrhlpjgKgnfM4TL1RYI%3D&amp;reserved=0" target="_blank"><strong><em>WES</em></strong></a><strong><em>and</em></strong><a href="https://nam02.safelinks.protection.outlook.com/?url=http%3A%2F%2Fwww.ece.org%2F&amp;data=04%7C01%7Cryanna.jackson%40stthomas.edu%7C1667856a96d041693c4408d9faf1a10e%7Ca081ff79318c45ec95f338ebc2801472%7C1%7C0%7C637816737983755844%7CUnknown%7CTWFpbGZsb3d8eyJWIjoiMC4wLjAwMDAiLCJQIjoiV2luMzIiLCJBTiI6Ik1haWwiLCJXVCI6Mn0%3D%7C3000&amp;sdata=Z2fSp46%2BWkjOZ6NYvd8Ln4XJT8tUao9z9r9xWPulkRU%3D&amp;reserved=0" target="_blank"><strong><em>ECE</em></strong></a><strong><em>. Please work with one of these services to obtain your evaluation. Its recommended that applicants request transcript evaluations at least six months prior to the start of the term in which they wish to start the program.</em></strong></p>','','','','Requirement_Item__c-602');
