INSERT INTO "Question__c" VALUES('Question__c-2437','true','','','','Started App;Submitted App','','','','','false','','','','','3.0','false','true','Started App','false','','','','','','','false','Test Score Preference Acknowledgement','','','','Test Score Preference Acknowledgement Statements (UGFR)','Name','false','','','','','','','','QuestionUuid-68c096e8-1c56-4df2-a36c-104479b2d408','','012DS00000AdtxdYAB','','Started App','','','By providing the information below, I understand that my self-reported test scores will be used in the admission review process. If I am offered admission and I enroll at the University of St. Thomas, I agree to submit official test scores before course registration. I understand that any discrepancies between self-reported and official test scores may cause St. Thomas to withdraw or modify my offer of admission.','','','','Requirement_Item__c-696');
