INSERT INTO "Question__c" VALUES('Question__c-2466','false','','','','Started App;Submitted App','','','UGFRCA-TOEFL-IELTS','','false','','','','','','false','true','','false','','','','','','','false','TOEFL/IELTS total score for CA','','','','TOEFL/IELTS (UGFRCA)','Name','false','','','','','','','','QuestionUuid-985b08ac-dbd4-4668-85b7-f8cdfc0d3954','','012DS00000AdtxeYAB','','Started App','','','','','','','Requirement_Item__c-694');
INSERT INTO "Question__c" VALUES('Question__c-2467','true','','','','Started App','','','','','false','','','','','0.0','false','true','Started App','false','','','','','','','false','','','','','Murray Institute Scholarship static (GCAS)','Name','false','','','','','','','','QuestionUuid-9206923f-f77f-44c4-b9a2-cdc875262e2f','','012DS00000AdtxdYAB','','','','','<p style="text-align: center;"><strong style="color: rgb(109, 54, 150); font-size: 18px;">Murray Institute Scholarship</strong></p><p><br></p><p>The Murray Institute for Catholic Education is a collaboration between the University of St. Thomas and the Archdiocese of Saint Paul and Minneapolis. The Murray Institutes mission is to support and sustain the educational ministries of the Archdiocese by providing graduate education for benefits-eligible educators of Catholic schools and parishes within the Archdiocese of Saint Paul and Minneapolis.</p><p><br></p><p>The Murray Institute supports graduate education for Murray-approved degrees at University of St. Thomas.The Murray Institute also supports Non-Degree Seeking applicants who wish to enroll in University of St. Thomas individual graduate courses not within a specific degree program.</p><p><br></p><p><strong style="font-family: truenoregular, Arial, sans-serif;">Eligibility</strong></p><p>To be eligible for Murray Institute funding, applicants shall:</p><ul><li>Employed through the Archdiocese of St. Paul and Minneapolis in educational ministries<em>(no minimum years of service required)</em>.</li><li>Hold a B.A. or B.S. degree from an accredited academic institution.</li><li>Undergraduate cumulative grade point average (GPA) of 3.0 (on a 4.0 scale).</li><li>Submit ALL official transcript(s) of all academic work, both undergraduate, transfer credits and graduate, if applicable.</li><li>Submit2-3 letters of recommendation, depending on the program requirements, attesting to the applicant&#39;s ability to enter this program. (1) letter of recommendation must come from the applicants principal or pastor.</li><li>Commit to working within the Archdiocese of St. Paul and Minneapolis for the duration of the program and up to 3 years upon completion of the program.</li></ul>','','','','Requirement_Item__c-356');
