INSERT INTO "Question__c" VALUES('Question__c-2725','true','','','','Started App;Submitted App','','','','','false','','','','','','false','true','Started App','false','','','','','','','false','','','','','Tuition and Billing Static(GCAS)','Name','false','','','','','','','','QuestionUuid-460aab7a-1508-4c9a-93a8-a9a9e8e6d869','','012DS00000AdtxdYAB','','','','','Summer term tuition and fee charges begin posting to student accounts in mid-May for students enrolled in courses by that point.The first summer eBill will be generated in late May and the first payment due date will be mid-June. After that date, eBills will be generated on a rolling basis following course enrollment.<br><br>If you need this timeline expedited for your school districts reimbursement deadlines, please contact the <a href="https://www.stthomas.edu/businessoffice/" target="_blank">Business Office</a>at <a href="mailto:busoffice@stthomas.edu" target="_blank">busoffice@stthomas.edu</a>to discuss details.<br><br>Details regarding eBilling can be found <a href="https://stthomas.edu/businessoffice/ebilling/" target="_blank">here</a>.','','','','Requirement_Item__c-354');
