INSERT INTO "Question__c" VALUES('Question__c-2867','true','','','','Started App;Submitted App','','','','','false','','','','','0.0','false','true','Started App','false','','','','','','','false','','','','','English Proficiency Waivers (GCAS)','Name','false','','','','','','','','QuestionUuid-aec4dbee-703a-4ef0-a048-d601f2acf2a9','','012DS00000AdtxdYAB','','','','','In addition to fulfilling admission requirements, applicants who do not have English as their native language* are required to provide proof of English proficiency from one of our approved English proficiency service providers. Score reports can be no more than two years old.<br><br>See specifics on <a href="https://www.stthomas.edu/admissions/graduate/international/index.html" target="_blank"><u>English proficiency exams, passing scores and ELS learning options</u></a>.<br><br><strong>*Proof of English proficiency is waived for the following students:</strong>
<ul><li>Permanent U.S. residents</li><li>Naturalized U.S. citizens</li><li>Applicants who have completed a bachelor&#39;s degree or higher from an English-speaking institution in the United States, Canada, the United Kingdom or Australia.</li></ul>','','','','Requirement_Item__c-382');
INSERT INTO "Question__c" VALUES('Question__c-2868','true','','','','Started App','','','','','false','','','','','','false','true','Started App','false','','','','','','','false','','','','','Murray Institute Sch Message (GSOE)','Name','false','','','','','','','','QuestionUuid-bf0b1fcf-f005-4abc-b9e0-d51d0c1ce6c6','','012DS00000AdtxdYAB','','','','','<p style="text-align: center;"><strong style="color: rgb(109, 54, 150); font-size: 24px;">IMPORTANT NOTICE</strong></p><p><br></p><p><strong style="color: rgb(109, 54, 150); font-size: 18px;">If you chose &quot;no&quot;in the Murray Institute scholarship eligibility option, please click &quot;Save and Continue&quot; to complete this section, and move on to the next section.</strong></p><p><br></p><p><strong style="color: rgb(109, 54, 150); font-size: 18px;">Otherwise, please click &quot;Next&quot; (If applicable) to upload your required documents for the Murray Institute scholarship.</strong></p>','','','','Requirement_Item__c-513');
