INSERT INTO "Question__c" VALUES('Question__c-2871','true','','','','Started App;Submitted App','','','','','false','','','','','13.0','false','true','Started App','false','','','','','','','false','','','','','ESL Authorization Statement(MURR)','Name','false','','','','','','','','QuestionUuid-66571207-0edd-4a71-ae87-98972a48d10f','','012DS00000AdtxdYAB','','Started App','','','I authorize St. Thomas to share all of the information I am submitting as part of this application with ELS Educational Services, Inc., which will automatically consider me for admission to the St. Thomas Pathway Program if I am not eligible for direct admission to the University of St. Thomas.<br>I understand that if I do not authorize St. Thomas to share information with ELS, ELS will not consider me for admission to the St. Thomas Pathway Program.','','','','Requirement_Item__c-717');
