INSERT INTO "Question__c" VALUES('Question__c-3019','true','','','','Started App;Submitted App','','','','','false','','','','','0.0','false','true','Started App','false','','','','','','','false','','','','','English Proficiency Waivers (GLAW)','Name','false','','','','','','','','QuestionUuid-a092dd34-1ead-40ae-b59e-d60fa9291e08','','012DS00000AdtxdYAB','','','','','In addition to fulfilling admission requirements, applicants who do not have English as their native language* are required to provide proof of English proficiency from one of our approved English proficiency service providers. Score reports can be no more than two years old.<br><br>See specifics on <a href="https://www.stthomas.edu/admissions/graduate/international/index.html" target="_blank"><u>English proficiency exams, passing scores and ELS learning options</u></a>.<br><br><br><strong>*Proof of English proficiency is waived for the following students:</strong>
<ul><li>Permanent U.S. residents</li><li>Naturalized U.S. citizens</li><li>Applicants who have completed a bachelor&#39;s degree or higher from an English-speaking institution in the United States, Canada, the United Kingdom or Australia.</li></ul>','','','','Requirement_Item__c-829');
INSERT INTO "Question__c" VALUES('Question__c-3020','true','','','','Started App;Submitted App','','','','','false','','','','','2.0','false','true','Started App','false','','','','','','','false','','','','','Application Materials Consent Text (SPSSD)','Name','false','','','','','','','','QuestionUuid-546c8c2c-a168-4197-b2d0-7b0079631d4e','','012DS00000AdtxdYAB','','Started App','','','<p><strong>Please affirm the following before you submit your application.</strong></p>

<p></p>

<p></p>

<p>I understand that I have reviewed each page of my application. I certify that the information contained in this application, including all attachments and credentials, is complete and true to the best of my knowledge. I understand that misrepresentation of application information is sufficient grounds for denial of admissions or cancellation of admissions and registration. I understand that all materials received by the University of St. Thomas in connection with this application are not returnable. <span style="color: #ff0000;">*</span></p>','','','','Requirement_Item__c-430');
