INSERT INTO "Question__c" VALUES('Question__c-3601','true','','','','','','','','','false','','','','','1.0','false','true','','false','','','','','','','false','','','','','PreApp Static (GMSWA)','Name','false','','','','','','','','QuestionUuid-c7f97c66-8bb2-4bdd-b6ba-c8dfeb7f7920','','012DS00000AdtxdYAB','','','','','<p><span style="font-size: 16px;">Junior BSW students who meet the following eligibility requirements may apply for the early admission to the MSW program:</span></p><ul><li><span style="font-size: 16px;">Admitted to the BSW major without conditions</span></li><li><span style="font-size: 16px;">Cumulative GPA of 3.0 and Social Work GPA of 3.5, documented with a degree evaluation</span></li><li><span style="font-size: 16px;">In good academic and professional standing (see the Professional Standards in the BSW Handbook) in the BSW program (as confirmed by the BSW Program Director)</span></li><li><span style="font-size: 16px;">Completion of undergraduate degree in May of the following year</span></li></ul><p><br></p>','','','','Requirement_Item__c-7');
