INSERT INTO "Question__c" VALUES('Question__c-3675','true','','','','Admit','','','','','false','','','','','1.0','false','true','','false','','','Housing Deposit Paid','','','','false','','','','','Second Deposit Confirming Only Enticement (UGTRDFC)','Name','false','','','','','','','','QuestionUuid-4626fc6a-c7a2-4ffc-aac3-51e5de206838','','012DS00000AdtxdYAB','','','','','<p><em>Thanks for you hosing deposit earlier. To reserve a spot in our upcoming class, you must submit a confirming deposit.</em></p><p></p><p>Please note:</p><ul><li>Students admitted to St. Thomas are expected to abide by certain conduct and fulfill obligations. The complete details are<a href="https://www.stthomas.edu/_media-library/_documents/main/admissions-code-of-conduct.pdf" target="_blank">found here</a>.</li><li>The University of St. Thomas requires all students, faculty and staff to be<a href="https://www.stthomas.edu/center-for-well-being/health-requirements/covid-19-vaccine/index.html" target="_blank">vaccinated for COVID-19</a>. Limited exemptions are available for religious and medical reasons.</li></ul><p>Click the Submit Deposit button below to proceed to our payment processing system.</p>','','','','Requirement_Item__c-20');
