INSERT INTO "Question__c" VALUES('Question__c-3710','true','','','','Started App;Submitted App','','','','','false','','','','','1.0','false','true','Started App','false','','','','','','','false','','','','','Request letter of Eligibility form link (GCAS)','Name','false','','','','','','','','QuestionUuid-93e165e5-51c1-448f-ac7e-1477ec25b06f','','012DS00000AdtxdYAB','','Started App','','','<p><span style="font-size: 16px; background-color: rgb(255, 255, 255);">The Archdiocese of Saint Paul and Minneapolis and the University of St. Thomas are pleased to partner together to provide opportunities for advanced study to teachers serving in Catholic schools through the Murray Institute. Murray Institute programming is funded by generous donors to support quality and excellence in Catholic education in the Archdiocese of Saint Paul and Minneapolis. </span></p><p><span style="font-size: 16px; background-color: rgb(255, 255, 255);">To help ensure that Murray funds are used according to donor intent to support the needs of the Archdiocese of Saint Paul and Minneapolis, you must request a letter of eligibility </span><span style="font-size: 14px; background-color: rgb(255, 255, 255);">&lt;</span><a href="https://catholiceducation.iad1.qualtrics.com/jfe/form/SV_1FjtcDT4AOPb8SF" target="_blank" style="font-size: 14px; background-color: rgb(255, 255, 255);">REQUEST FORM HERE</a><span style="font-size: 14px; background-color: rgb(255, 255, 255);">&gt;</span><span style="font-size: 16px; background-color: rgb(255, 255, 255);"> from the Archdiocese of St. Paul and Minneapolis.In order to submit this application, please type &quot;Complete&quot; in the box below to confirm your request.</span><span style="font-size: 16px; background-color: rgb(255, 255, 255); color: rgb(255, 0, 0);">*</span></p>','','','','Requirement_Item__c-477');
INSERT INTO "Question__c" VALUES('Question__c-3711','true','','','Murray_Scholarship_Signature__c','Started App;Submitted App','','','','','false','','','','','4.0','false','true','Started App','false','','','','','','','false','By initialing here, you agree to the above statement.','','','','Completion Statement Initials (GCAS)','Name','false','','','','','','','','QuestionUuid-efda81e7-f5fb-4bf9-bc2e-0ef7d709da36','','012DS00000AdtxeYAB','','Started App','','','','','','','Requirement_Item__c-477');
INSERT INTO "Question__c" VALUES('Question__c-3712','true','','','','Started App;Submitted App','','','','','false','','','','','3.0','false','true','Started App','false','','','','','','','false','','','','','Completion Static (GCAS)','Name','false','','','','','','','','QuestionUuid-db4cbebe-0684-45a6-a0f6-0eec2a08897b','','012DS00000AdtxdYAB','','Started App','','','<p>Murray Institute programs offer personal and professional growth through higher education at the University of St. Thomas for individual educators employed within the Archdiocese of St. Paul and Minneapolis. The education you receive is then, in turn, intended to enhance the communities you serve within Archdiocesan schools and parishes.</p><p>The Murray Institute requires applicants to maintain employment within the Archdiocese throughout the duration of the program and also requires a 3-year commitment working within a Catholic school or parish within the Archdiocese of St. Paul and Minneapolis upon completion of a Murray Institute program.</p><p><br></p><p>I agree to the above statement.</p>','','','','Requirement_Item__c-477');
