INSERT INTO "Question__c" VALUES('Question__c-3782','true','','','','Started App;Submitted App','','','','','false','','','','','0.0','false','true','Started App','false','','','','','','','false','','','','','English Proficiency Waivers (GSPP)','Name','false','','','','','','','','QuestionUuid-7eeec260-c17f-4390-9ef5-06c0c0f2a49e','','012DS00000AdtxdYAB','','','','','In addition to fulfilling admission requirements, applicants who do not have English as their native language* are required to provide proof of English proficiency from one of our approved English proficiency service providers. Score reports can be no more than two years old.<br><br>See specifics on <a href="https://www.stthomas.edu/admissions/graduate/international/index.html" target="_blank"><u>English proficiency exams, passing scores and ELS learning options</u></a>.<br><br><br><strong>*Proof of English proficiency is waived for the following students:</strong>
<ul><li>Permanent U.S. residents</li><li>Naturalized U.S. citizens</li><li>Applicants who have completed a bachelor&#39;s degree or higher from an English-speaking institution in the United States, Canada, the United Kingdom or Australia.</li></ul>','','','','Requirement_Item__c-200');
