INSERT INTO "Question__c" VALUES('Question__c-4013','true','','','','','','','','','false','','','','','4.0','false','true','','false','','','','','','','false','','','','','Special Circumstances Static (GSSW)','Name','false','','','','','','','','QuestionUuid-30acdfab-8060-450a-b5e6-37aadfbe02ce','','012DS00000AdtxdYAB','','','','','<p><span style="color: rgb(0, 0, 0); font-size: 16px;">If you feel it would be pertinent to your application, please take this opportunity to contextualize your academic journey (for example, if you have a non-social work background, are making a career change, or your undergraduate grades do not reflect your academic preparedness). Provide us with any details or explanations that will help the reviewers accurately understand your previous academic performance and experiences. As well, please address what support systems you have in place to help you succeed in your graduate studies. (250 words):</span></p>','','','','Requirement_Item__c-189');
