INSERT INTO "Question__c" VALUES('Question__c-4048','true','','','','','','','','','false','','','','','22.0','false','true','','false','','','','','','','false','','','','','Consent Instr 2 Static (SOEd)','Name','false','','','','','','','','QuestionUuid-d54fd1eb-2ece-4f23-af14-35e802ce4f2e','','012DS00000AdtxdYAB','','','','','<p>The district and building leaders agree to employ the paraprofessional, Tier I or Tier II teacher during the Work and Learn Program. If at any point during the Work and Learn program the candidate is no longer employed by the district, it is the candidate&#39;s responsibility to notify the University of St. Thomas of changes in employment status.</p>','','','','Requirement_Item__c-689');
INSERT INTO "Question__c" VALUES('Question__c-4049','true','','','','','','','','','false','','','','','20.0','false','true','','false','','','','','','','false','','','','','Consent Instr 1 Static (SOEd)','Name','false','','','','','','','','QuestionUuid-9483a2fe-f5f2-41b6-9ddf-7a4ac7b78613','','012DS00000AdtxdYAB','','','','','<p>The Work and Learn candidate is expected to adhere to the same expectations that the district has for all teachers. These expectations include, but are not limited to work hours, workshop requirements, due process requirements and timelines, and meetings/ conferences. During the final two semester of the program, the Work and Learn candidate is required to be in the classroom and teaching students with special needs. If the candidate is employed by the district as a paraprofessional, during the second year of the program (field experience &amp; student teaching), the district agrees to gradually relieve the candidate of his/her/their paraprofessional duties. This will allow the candidate to take the role of a full-time Special Education teacher during the student teaching experience.</p>','','','','Requirement_Item__c-689');
