INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-49','False','False','False','','Started App;Submitted App','','','','','1.0','True','True','Started App','','','','','','','','<center><b><Font size=4 Font color=#6d3696>Statement of Purpose</b></Font><Font color=Red>*</Font></center>

<br>

This component of your application to the MA in Diversity Leadership at the University of St. Thomas will be used to assess your writing, critical thinking, and capacity for self-awareness and self-reflection in terms of readiness for graduate-level work.

<br>

Please respond to each of the following questions in no more than two (2) pages, double-spaced.

<br>

<br>

1. Please describe your personal, educational, volunteer, or professional experiences, qualifications, or qualities that led to your interest in pursuing a masters degree in diversity leadership at the University of St. Thomas.

<br><br>

2. What are your professional goals? What are ways in which the M.A. in Diversity Leadership at the University of St. Thomas can support your professional aspirations?

