INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-160','True','False','False','','','','','Master''s','','','True','False','','','','','','','','0014P000042RTrW','Thanks for answering the questions above. Please attach a separate letter providing feedback regarding applicant''s academic, professional, and personal characteristics including:



* Circumstances in which you are familiar with the applicants work, and the nature of the work that they performed

* Applicants ability and demonstration for self-reflection, engagement, empathy, and respect for others

* Their engagement as a learner and preparation for graduate education (if applicable)

* And personal, professional, or educational related experiences that will prepare the applicant for advanced social work practice; demonstrated experiences and examples are encouraged as it will help in determining the applicants fit with our program.



More information regarding our mission and goals can be found on our website https://www.stthomas.edu/socialwork/about/. Our application deadline is January 10.','','False','True','Upload Letter of Recommendation','','Letter of Recommendation 2 of 2 MSW (GSSW)','','','','012DS00000AdtxiYAB','','','Recommendation__c','','','','','Started App;Submitted App;Complete App','ReqItemUuid-807bbae0-932d-4faf-ab85-2cdc69142e75','','','','False','','Requirement_Item__c-295','Requirement__c-294');
