INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-162','True','False','False','','','','','Doctoral','','','True','False','','','','','','','','0014P000042RTrW','The DSW application deadline is January 15.All letters of recommendation must be received by this date for the application to be considered complete for priority review.



We will appreciate a recommendation from you concerning the person named above who is an applicant to the University of St. Thomas. 



Please provide ratings to the criteria listed below, and upload an accompanying statement that addresses the applicants potential for success in an online doctoral program focused on education as practice.



Areas to consider:

- The applicants commitment, capability, and suitability for teaching in social work, including ethical standards and commitment to social justice



- Ability to work with people from diverse backgrounds and abilities



- Work performance and workload management abilities



- Capacity for contributing to social work knowledge through writing and scholarship.','','False','True','Upload Letter of Recommendation','','Letter of Recommendation 1 of 3 DSW (GSSW)','','','','012DS00000AdtxiYAB','','','Recommendation__c','','','','','Started App;Submitted App;Complete App','ReqItemUuid-a899ac55-a80c-480a-bc37-3092cd001e74','','','','False','','Requirement_Item__c-296','Requirement__c-294');
