INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-181','False','False','False','','','','','Doctoral','','1.0','True','False','','','','','','','','0014P000042RTrW','Three (3) letters of recommendation are required for this application. Please provide contact information below for individuals who can attest to your skills and experience.','','False','False','Recommender Information','3.0','Recommender Information Doctorate (GSSW)','','','','012DS00000AdtxkYAB','Application__c','Application','Recommendation__c','','','3.0','','','ReqItemUuid-225cd759-02ce-4474-93ca-edfb51754aca','','','','False','','','Requirement__c-294');
INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-182','False','False','False','','','','','Master''s','','1.0','True','False','','','','','','','','0014P000042RTrW','Two (2) letters of recommendation are required for the MSW application. Please provide contact information below for individuals who can attest to your skills and experience. MSW recommendation forms must be completed by individuals who can attest to applicant''s readiness for graduate social work education, including: 

<p>

<ul><li>Self-reflection, engagement, and respect for others

<li>Engagement as a learner and preparation for graduate education

<li>Previous related experiences - personal, professional, or educational - that would prepare the applicant for advanced social work practice. <li></ul>

<p>

Only professional, community or academic references will be considered; personal references are not acceptable. References must complete both the checklist and the accompanying statement sections of the form. A link to the recommendation form will be sent when the recommendations section of the MSW application form has been completed. Please alert your references in advance to expect an email. These are confidential recommendations submitted directly from the references to the Office of Graduate Admissions; applicants who wish to view the recommendations are responsible for making the appropriate arrangements with their references.','','False','False','Recommender Information','3.0','Recommender Information Masters (GSSW)','','','','012DS00000AdtxkYAB','Application__c','Application','Recommendation__c','','','3.0','','','ReqItemUuid-ffc1a564-4640-41a5-867b-9c876266c546','','','','False','','','Requirement__c-294');
INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-183','True','False','False','','','','','Doctoral','','','True','False','','','','','','','','0014P000042RTrW','The DSW application deadline is January 15.All letters of recommendation must be received by this date for the application to be considered complete for priority review.



We will appreciate a recommendation from you concerning the person named above who is an applicant to the University of St. Thomas. 



Please provide ratings to the criteria listed below, and upload an accompanying statement that addresses the applicants potential for success in an online doctoral program focused on education as practice.



Areas to consider:

- The applicants commitment, capability, and suitability for teaching in social work, including ethical standards and commitment to social justice



- Ability to work with people from diverse backgrounds and abilities



- Work performance and workload management abilities



- Capacity for contributing to social work knowledge through writing and scholarship.','','False','True','Upload Letter of Recommendation','','Letter of Recommendation 2 of 3 DSW (GSSW)','','','','012DS00000AdtxiYAB','','','Recommendation__c','','','','','Started App;Submitted App;Complete App','ReqItemUuid-80365123-1c2c-4cdb-a8dd-33c86179167a','','','','False','','Requirement_Item__c-297','Requirement__c-294');
