INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-224','True','False','False','','Started App;Submitted App','','','Doctoral','','5.0','True','True','Started App','','','','','','','','To demonstrate your academic writing skills and provide evidence of your ability to think critically and analytically, please write a paper on a topic of interest to you in social work.

<br>

<br>

<p><ul><li>You may wish to consider a topic you are interested in as a focus for your banded dissertation or that relates to social work education.</li></ul>

<p><ul><li>The writing sample should be 3-5 pages in length and formatted in APA Style, including a title page and reference section (not included in the 3-5 page limit).</li></ul>

     <p><ul><ul><li> Examples include: essay, brief literature review, conceptual paper, or a section of a longer paper.</li></ul></ul>

     <p><ul><ul><li> If your writing sample is from a longer paper, it must be from the past year and you must provide a brief (2-3 sentence) introductory statement to provide context for the reviewer.</li></ul></ul>



 <br>



<i>Please upload a document to answer the following essay question(s). File must be an MS Word (.doc or .docx), Rich Text Format (.rtf), Text (.txt) or PDF (.pdf) document and not exceed 4 MB. Please be advised, PDF file format uploads are strongly recommended, as other file formats may be altered during the upload process.</i>','','False','False','Writing Sample','','Writing Sample Doctor (GSSW)','','','','012DS00000AdtxiYAB','','','','','','','','Started App','ReqItemUuid-b5e51da3-c58a-4484-89d5-f1d434be93ff','','','','True','','','Requirement__c-301');
