INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-226','True','False','False','','Started App;Submitted App','','','Doctoral','','4.0','True','True','Started App','','','','','','','','Prepare a written response to each of the following: (Complete personal statement should be no longer than 6 double-spaced pages)

<br>

 What circumstances and experiences motivate you to seek a Doctorate in Social Work (DSW) in Education as Practice, with its teaching, scholar practitioner and leadership roles, at this point in your career?

</br>

<br>

 Describe your vision of leadership in social work education and indicate how you see yourself implementing this vision as an educational leader.

</br>

<br>

 Identify and reflect on your strengths and limitations relative to successfully completing an online and doctoral program; include dimensions such as your ability to be a self-directed learner, writing experience and ability, and things you have done to develop your academic skills.

</br>','','False','False','Personal Statement','','Personal Statement Doctor (GSSW)','','','','012DS00000AdtxiYAB','','','','','','','','Started App','ReqItemUuid-4d0efca5-fe59-42b2-a1cb-a234628ee664','','','','True','','','Requirement__c-301');
INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-227','True','False','False','','Started App;Complete App','','','Master''s','','2.0','True','True','Started App','','','','','','','','The personal statement component of your application to the MSW Program at the University of St. Thomas will be used to assess your writing, critical thinking, and capacity for self-awareness and self-reflection in terms of readiness for graduate level work and supervised practice in the field. Please respond to each of the following questions in no more than two (2) pages, doubled spaced.

<br>

<br>

1. Please describe your personal, educational, volunteer, or professional experiences, qualifications or qualities that led to your interest in pursuing a masters degree in social work at the University of St. Thomas.

</br>

<br>

2. What are your professional goals? What are ways in which the School of Social Work at the University of St. Thomas can support your professional aspirations?

</br>

<br>

3. The below statement from the Council on Social Work Education is a description of one of the nine core competencies, Engage Diversity and Difference in Practice, MSW students should attain during the course of their MSW degree. Please review the description and describe how you will engage diversity and difference in practice through your professional goals you identified in the previous question.

<p><ul><li>Social workers understand how diversity and difference characterize and shape the human experience and are critical to the formation of identity. The dimensions of diversity are understood as the intersectionality of multiple factors including but not limited to age, class, color, culture, disability and ability, ethnicity, gender, gender identity and expression, immigration status, marital status, political ideology, race, religion/spirituality, sex, sexual orientation, and tribal sovereign status. Social workers understand that, as a consequence of difference, a persons life experiences may include oppression, poverty, marginalization, and alienation as well as privilege, power, and acclaim.</li></ul>

<p><ul><li>Social workers also understand the forms and mechanisms of oppression and discrimination and recognize the extent to which a cultures structures and values, including social, economic, political, and cultural exclusions, may oppress, marginalize, alienate, or create privilege and power. Social workers:</li></ul>

<p><ul><ul><li>Apply and communicate understanding of the importance of diversity and difference in shaping life experiences in practice at the micro, mezzo, and macro levels</li></ul></ul>

<p><ul><ul><li>Present themselves as learners and engage clients and constituencies as experts of their own experiences</li></ul></ul>

<p><ul><ul><li>Apply self-awareness and self-regulation to manage the influence of personal biases and values in working with diverse clients and constituencies.</li></ul></ul>

</br>

<br>

<i>Please upload a document to answer the following essay question(s). File must be an MS Word (.doc or .docx), Rich Text Format (.rtf), Text (.txt) or PDF (.pdf) document and not exceed 4 MB. Please be advised, PDF file format uploads are strongly recommended, as other file formats may be altered during the upload process.</i>

</br>','','False','False','Personal Statement','','Personal Statement (GSSW)','','','','012DS00000AdtxiYAB','','','','','','','','Started App','ReqItemUuid-fa3358c2-6686-46d8-be23-bb7d303a073e','','','','True','','','Requirement__c-301');
