INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-229','False','False','False','','Started App','','','Master''s','','1.0','True','True','Started App;Complete App','','','','','','','','This section of the application provides an opportunity to demonstrate your written communication skills, understanding of an issue relevant to social work, ability to critically assess the dimensions of the issue and preparation for graduate-level writing.

<br>

Assigned reading: Jones, C. P. (2000). Levels of racism: A theoretic framework and a gardeners tale. American Journal of Public Health, 90, 1212-1215. https://www.ncbi.nlm.nih.gov/pmc/articles/PMC1446334/pdf/10936998.pdf 

</br>

<br>

In between 500 to 1000 words (two to three pages double-spaced), please respond to the following questions on Joness article. Your response should be written using formal, academic language with APA style citations and a reference list. You are welcome (but not required to) include references other than the assigned article.

</br>

<br>

Your assignment:

 Provide a brief overview of the key concepts of the article.

 Relate the key concepts to the mission and vision of the Morrison Family College of Health (MFCOH) (https://health.stthomas.edu/about/mission-vision/index.html) and School of Social Work (SSW) (https://health.stthomas.edu/social-work/graduate/masters/index.html).

 Provide examples of three levels of racism in clinical social work practice.

 How would you integrate this into your future learning experiences and/or social work practice?

</br>

<br>

