INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-237','True','False','True','','','','','','','1.0','True','True','','','','','','','','','Submitting an essay is a chance to write directly to the committee reviewing your application and it gives you a chance to help us get to know you better. Essays demonstrate your ability to write clearly and concisely on a selected topic and distinguish yourself in your own voice. <i>Essays are recommended, but not required. </i> </br></br>



<b>Essay 2 Topic:</b></br></br>



It is important to St. Thomas that all members of our community understand our dedication to providing an inclusive living and learning environment. <i>We would like to hear your observations and thoughts about diversity and inclusion based on what you have learned in your lifetime.</i></br></br>



<b><i>Please enter your essay in the space provided or upload it using the button below.</i></b></br></br>','','False','False','Essay 2','','Upload Essay 2(UGFRCA)','','','','012DS00000AdtxiYAB','','','','','','','','','ReqItemUuid-93587801-811e-46cb-94cb-0834d01803e7','','','','True','','','Requirement__c-142');
INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-238','True','False','True','','','','','','','0.0','True','True','','','','','','','','','Submitting an essay is a chance to write directly to the committee reviewing your application and it gives you a chance to help us get to know you better. Essays demonstrate your ability to write clearly and concisely on a selected topic and distinguish yourself in your own voice. <i>Essays are recommended, but not required. </i> </br></br>

You may choose one of the topics described below or submit a paper you have written for class.  </br></br>

<b>Essay 1 Topics:</b></br></br>

1. Discuss a meaningful contribution you have made through involvement in school, church or community activities.</br>

2. Describe an event, a person or an educational experience that has had a major impact on your life and why.</br>

3. Share additional information about your personal story that would be beneficial to the application review process. What do you want the readers to know about you apart from courses, grades and test scores?</br></br>

<b><i>Please enter your essay in the space provided or upload it using the button below.</i></b></br></br>','','False','False','Essay 1','','Upload Essay 1(UGFRCA)','','','','012DS00000AdtxiYAB','','','','','','','','','ReqItemUuid-361f5b6a-4f80-4a7b-a4dc-fdec8ec41793','','','','True','','','Requirement__c-142');
INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-239','True','False','False','','Started App','','','Certificate','','1.0','True','True','Started App','','','','','','','0014P000042RTrW','Three (3) letters of recommendation are required for this application. Please provide contact information below for recommenders who can attest to your skills and experience. <br><br>Your recommenders should include the following: (1) an academic reference, such as a former professor, who can speak to your academic preparedness to do graduate level course work; (2) your pastor, who should comment on those attributes that make you a suitable candidate for a leadership position in a Catholic school; and (3) your principal or direct supervisor at your school who can speak to your leadership skills and experience. If your pastor is your direct supervisor, this third letter of recommendation can be from a colleague.','','False','False','Request Recommendation','','Request Recommendation 2 of 3 Cert (SPSSD)','','','','012DS00000AdtxjYAB','','','Recommendation__c','','','','','Started App','ReqItemUuid-d35cefca-858d-4457-a1ef-b8b90a87b264','','','','True','','','Requirement__c-189');
