INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-286','True','False','False','','Started App','','','','','1.0','True','True','Started App','','','PS_GR_PSD|CPSY','','','','0014P000042RTrW','Two (2) letters ofrecommendationare required for the PsyD in Counseling Psychologyapplication. Please provide contact information below forindividualswho can attest to your skills and experience. Recommendation forms must be completed by individuals who can attest to the applicants readiness for graduate counseling psychology education and practice, including:



<br>



<br>



 Empathy, self-knowledge, and respect for others



<br>



 Engagement as a learner, intellectual capability, written communication, and preparation for graduate education



<br>



 Previous related experiences- personal, professional, or educational that would prepare the applicant for counseling psychology practice



<br>



<br>



