INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-327','True','False','False','','','','','','','','True','True','','','','','','','','','<center><b><Font size=4 Font color=#6d3696>Resume </b></Font><Font color=Red>*</Font></center>

<br>

Please submit a (1-2) page responses to the following questions. This resume information section includes questions about any paid or unpaid experiences related to health care, service, leadership or involvement with teams, and community-based social justice activities. If the experience(s) occurred with a formal organization(s), please include the organization(s) name, address, and contact person with whom you worked. 



<br>



<br>



