INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-340','True','False','False','','','','','','','2.0','True','False','','','','BU_EX_MBA|EXMB','','','','','<center><Font size=4 Font color=#6d3696><b>Dean''s Scholarship</b></Font></center>



<br>



Merit-based scholarships are available to select candidates with strong applications. All applicants are automatically considered for the Deans Scholarship. No separate essay is required.



<br>



<br> 

<center><Font size=4 Font color=#6d3696><b>$10,000 Guaranteed Scholarship</b></Font></center>

<br>

Students who submit their application by June 30 and are admitted to the Executive MBA program will receive an automatic $10,000 scholarship towards the cost of the program.



<br>

<br>

<center><Font size=4 Font color=#6d3696><b>Non-profit Scholarship</b></Font></center>



<br>



All applicants with a demonstrated commitment to the non-profit sector are automatically considered for the Non-profit Scholarship. To be eligible, you must have two or more years full-time work experience at an established non-profit organization and show evidence of a strong dedication to serving the community. No separate essay is required.



<br>

<br>



<center><Font size=4 Font color=#6d3696><b>Alumni Referral Scholarship</b></Font></center>



<br>



If you were referred to the Executive MBA program by one of our current Executive MBA students or alumni, you are eligible for our Alumni Referral Scholarship award. How to qualify:

<br>

The Executive MBA student or alumni that refers you <b>must fill out this <a href="https://forms.office.com/Pages/ResponsePage.aspx?id=ef-BoIwx7EWV8zjrwoAUch7xqw3EL3dKqXuNJi9hXhZUOFlUTEcxNldYU0YwQktFTEVIWTkxMTQ1Ty4u&wdLOR=c351C8892-E285-C443-BE8F-2B9919A5DD67" method="get" target="_blank">Form</a>.</b>

<br>If you are accepted to the program after being referred, you will receive a $1,000 scholarship towards your first semester in the program.

<br>The Executive MBA alumni or student who referred you will receive a St. Thomas Executive MBA pullover.



<br>

<br>



<center><Font size=4 Font color=#6d3696><b>Diversity and Inclusion Scholarship</b></Font></center>



<br>



Scholarships are available to applicants who demonstrate a history of academic and professional success, leadership, service, and engagement in cultural or cross-cultural initiatives in previous academic, professional, or volunteer settings. Strong candidates will be domestic candidates with two or more years of full-time work experience after college graduation, have a strong undergraduate academic record, and show evidence of committed involvement in activities, programs, or initiatives that foster inclusion, cross-cultural awareness, or a commitment to diversity in its many forms. <b>To be considered, review the scholarship requirements on our website and submit a statement</b> (no more than 300 words) describing the most relevant experiences that qualify you for this award.','','False','False','Scholarships','','All Scholarships - MBA EXEC (GOCB)','','','','012DS00000AdtxiYAB','','','','','','','','','ReqItemUuid-850ef1c7-e634-4317-89c5-103f333f5cf3','','','','True','','','Requirement__c-13');
