INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-457','True','False','False','','Submitted App','','','','','','True','True','','','','','','','','','You have applied to participate in our Work and Learn Cohort. One of the application requirements is an endorsement from your district. This requirement ensures you will be supported and offered the required opportunities through your student teaching. We will need an endorsement from each of the following:

<br>

<br>

1) The Director or Assistant Director of Special Education

<br> 

<br>

2) The lead Administrator for your building or site. In most cases, the principal.

<br>

<br> 

Once you have submitted your application, you will receive a link to share these endorsements.','','False','False','District/School Endorsement','','District/School Endorsement','','','','012DS00000AdtxjYAB','','','','','','','','','ReqItemUuid-ec8ae73c-ef20-4d05-8b57-37ab811473e8','','','','True','','','Requirement__c-212');
