INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-516','True','False','False','','Started App;Submitted App','','','','','4.0','True','True','Started App','','','','','Yes','','','<b>Upload Personal Statement</b><Font color=Red>*</Font>

<br>

<br>

The Murray Institute Faculty Committee is interested in hearing about your experience in Catholic education, your commitment to Catholic education, as well as your sense of how participating in this particular Murray program would facilitate your personal and professional goals in relation to the needs of your school or parish as it serves the larger goals of the Archdiocese. Please upload a Word document or PDF answering the following questions:

<br>

<ol>



<li>Summarize your educational experience (degrees, certificates, licenses, etc.) </li>



<li>Share your professional experience working in Catholic education (the expectation is that you must be under contract with the Archdiocese of St. Paul/Minneapolis). </li>



<li>Note your personal commitment to working in Catholic education within the Archdiocese for at least three years upon completion of this Murray program. </li>



<li>Address how and why this program addresses your professional goals and the goals of your school or parish. </li>

</ol>

<br>

<i>File must be a MS Word (.doc or .docx), Rich Text Format (.rtf), Text (.txt) or PDF (.pdf) document, and not exceed 4 MB. Please be advised, PDF file format uploads are strongly recommended as other file formats may be altered during the upload process. </i>','','False','False','','','Murray Institute Scholarship Personal Statement (GSOE)','','','','012DS00000AdtxiYAB','','','','','','','','Started App','ReqItemUuid-4442a7fc-0f78-46b5-a031-77ae1b7db4b5','','','','True','','','Requirement__c-261');
