INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-519','True','False','False','','Submitted App','','','','','','True','True','','','','','','','','','Advanced-standing applicants must submit a copy of the senior fieldwork evaluation from their undergraduate social work program. Applicants may submit a copy of the evaluation from their own records (if they retained the paperwork after graduation). Otherwise, applicants should contact the social work department at their undergraduate institution and request that a copy be to us.

<br>

<br>

Fieldwork evaluations can be emailed directly to the University of St. Thomas as a PDF to: gradadmissions@stthomas.edu; Subject line: Field evaluation for MSW applicant [YOUR NAME]

<br>

<br>

If the evaluation is no longer available, the social work department should submit a brief letter of explanation. If your undergraduate institution sends you an email explaining that they no longer have your evaluation, you may forward this email to gradadmissions@stthomas.edu as an acceptable explanation (Subject line: Field evaluation related to MSW applicant [YOUR NAME]). Students who have not yet completed their senior field placement may submit a copy of their junior fieldwork evaluation.','','False','False','District/School Endorsement','','Fieldwork  Instructor Evaluation Submitted (GSSW)','','','','012DS00000AdtxjYAB','','','','','','','','Submitted App','ReqItemUuid-b642c5db-3933-4b6c-bfda-1f4b08d887f3','','','','True','','','Requirement__c-305');
