INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-523','True','False','False','','','','','','','','True','True','','','','','','','','','<center><b><Font size=4 Font color=#6d3696>Prerequisites</b></Font><Font color=Red>*</Font></center>



<br>



<br>

To apply for the Bachelor of Science in Nursing major, applicants must be enrolled in or have completed all of the following courses:

<br>

<br>

<b>Must be completed:</b>

<ul>

<li>BIOL 105 or BIOL 207</li>

</ul>

<br>



<b>Must be completed or enrolled for Spring 2023:</b>

<ul>

<li>MATH 100/101 or placement into higher MATH course</li>

<li>NURS 110 - must be taken at the University of St. Thomas</li>

<li>CHEM 108 - CHEM 11 may substitute PSYC 111</li>

</ul>

<br>



<b>*For all completed courses, applicants must have earned a grade of C- or higher.</b>','','False','False','','','Prerequisites (UGBSN)','','','','012DS00000AdtxjYAB','','','','','','','','','ReqItemUuid-20e7bd34-cdd2-49d1-9f00-5502a343d038','','','','True','','','Requirement__c-38');
