INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-525','True','False','False','','Started App;Submitted App','','','','','1.0','True','True','Started App','','','','','','','','<center><b><Font size=4 Font color=#6d3696>Statement of Purpose</b></Font><Font color=Red>*</Font></center>

