INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-555','True','False','False','','Started App','','','Master''s;Certificate','','2.0','True','True','Started App','','','','','','','','<center><b><Font size=4 Font color=#6d3696>Scholarship Letter</b></Font></center>



<br>



<br>



1. Please prepare and attach a one-page letter indicating your desire to be considered for a scholarship. The letter should include a statement about your enthusiasm for the mission of <b>The Saint Paul Seminary School of Divinity</b> and your commitment to lifelong service. This letter should include an account of any outside funding you will receive to pursue further studies. In addition, please address how a scholarship will help you attain your long-term career or ministry goals.  



<br>File must be a MS Word (.doc or .docx), Rich Text Format (.rtf), Text (.txt) or PDF (.pdf) document and not exceed 4 MB. <i> Please be advised, PDF file format uploads are strongly recommended as other file formats may be altered during the upload process.</i>



<br>



<br>



2. Please note you need to complete a FAFSA to be considered for scholarship awards. Information about FAFSA can be found



<a href="http://www.stthomas.edu/financialaid/graduate/basics/applyfinaid/" method="get" target="_blank">here</a> .  



<br>



<br>



3. Upon admission, candidates will have agreed to the <a href="https://s3.amazonaws.com/archspmpolicies/100/105_Code+of+Conduct+for+Church+Personnel.pdf" method="get" target="_blank">Archdiocesan Code of Conduct.</a>





<br>



<br>



4. Finalists may be invited to interview with the committee in order to discuss their application in greater detail.   



<br>



<br>



5. Recipients will receive an award notice shortly after an admission decision.','','False','False','Scholarship Letter','','Scholarship Letter (SPSSD)','','','','012DS00000AdtxiYAB','','','','','','','','','ReqItemUuid-feb34225-886c-4f1a-ba88-204b6116b8a2','','','','False','','','Requirement__c-185');
