INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-619','True','False','True','','Started App','','','','','2.0','True','True','Started App','','','ED_EL_EDS|ELPR;ED_EL_EDS|ESEA;ED_EL_EDS|SADI','','','','','<center><b><Font size=4 Font color=#6d3696>Personal Statement</b></Font><Font color=Red>*</Font></center>

<br>

<br>

The mission of the University of St. Thomas School of Education is to educate practitioners to be: 1. morally responsible leaders, who 2. think critically, 3. act wisely, and 4. work skillfully, 5. to advance the common good. In the context of the Mission, please share your experience with discussing sensitive information with a parent/guardian, colleague, or administrator. What strategies did you use to create a positive conversation and arrive at a resolution or plan for moving forward? What have you learned from these encounters, and how has your learning shaped your approach for future encounters? Your response should not be less than 500 words, and not exceed 750 words.

<br>

<br>

Please upload a document to answer the following essay question(s). File must be a MS Word (.doc or .docx), Rich Text Format (.rtf), Text (.txt) or PDF (.pdf) document, and not exceed 4 MB.<i> Please be advised, PDF file format uploads are strongly recommended as other file formats may be altered during the upload process.  </i>','','False','False','Personal Statement','','Personal Statement - Ed Lead - Sped (GSOEd)','','','','012DS00000AdtxiYAB','','','','','','','','Started App','ReqItemUuid-67c0cac4-bf38-4f2c-8729-f4e63b21643e','','','','True','','','Requirement__c-199');
