INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-621','True','False','True','','Started App','','','Doctoral','','3.0','True','True','Started App','','','','','','','','<center><b><Font size=4 Font color=#6d3696>Professional/Academic Portfolio</b></Font><Font color=Red>*</Font></center>

<br>

<br>

If you have not taken the GRE or MAT, and do not plan to take one of these accepted admissions assessments, you may choose to submit a digital portfolio. If you choose this option, the following elements are required to complete your digital portfolio:

<br>

<br>

Five to seven electronic artifacts illustrating your accomplishments as an educational leader. Please include a statement explaining why you selected each artifact, and describe how the artifact demonstrates your ability/accomplishments as an educational leader in K-12, Higher Education or Adult Education. Examples to consider including in your portfolio:

<br>

<br>

* Copy of a brochure inviting people to attend a seminar you planned. Describe the purpose of the seminar and how the seminar helped to support student/adult learning in your school or workplace.

<br>

* Video clip of a presentation made before a professional group. Include the reason for the presentation, material used and the goals accomplished. You might also submit a

<br>

* An article published in an academic or community journal/newspaper.

<br>

The artifacts should demonstrate your most effective work as a leader in your field.

<br>

<br>

Please upload a document to answer the following essay question(s). File must be a MS Word (.doc or .docx), Rich Text Format (.rtf), Text (.txt) or PDF (.pdf) document, and not exceed 4 MB.<i> Please be advised, PDF file format uploads are strongly recommended as other file formats may be altered during the upload process.  </i>','','False','False','Professional/Academic Portfolio','','Professional/Academic Portfolio Doct(GSOEd)','','','','012DS00000AdtxiYAB','','','','','','','','Started App','ReqItemUuid-47d678a1-310f-49ee-962e-bfa8e6264359','','','','True','','','Requirement__c-199');
