INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-703','True','False','True','','','','UGFRCA-ESSAY2','','','1.0','True','True','','','','','','','','','Submitting an essay is a chance to write directly to the committee reviewing your application and it gives you a chance to help us get to know you better. Essays demonstrate your ability to write clearly and concisely on a selected topic and distinguish yourself in your own voice. <i>Essays are recommended, but not required. </i> </br></br><b>Essay 2 Topic:</b></br></br>It is important to St. Thomas that all members of our community understand our dedication to providing an inclusive living and learning environment. <i>We would like to hear your observations and thoughts about diversity and inclusion based on what you have learned in your lifetime.</i></br></br><b><i>Please enter your essay in the space provided or upload using the button below.</i></b></br></br>','','False','False','Essay 2','','Upload Essay 2(UGFR)','','','','012DS00000AdtxiYAB','','','','','','','','','ReqItemUuid-e2938c3e-696e-4879-bfb6-1e2ec8080b31','','','','True','','','Requirement__c-119');
INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-704','True','False','True','','','','UGFRCA-ESSAY1','','','0.0','True','True','','','','','','','','','Submitting an essay is a chance to write directly to the committee reviewing your application and it gives you a chance to help us get to know you better. Essays demonstrate your ability to write clearly and concisely on a selected topic and distinguish yourself in your own voice. <i><b>Essays are recommended, but not required. </b></i> </br></br>You may choose one of the topics described below or submit a paper you have written for class.  </br></br><b>Essay 1 Topics:</b></br></br>1. Discuss a meaningful contribution you have made through involvement in school, church or community activities.</br>2. Describe an event, a person or an educational experience that has had a major impact on your life and why.</br>3. Share additional information about your personal story that would be beneficial to the application review process. What do you want the readers to know about you apart from courses, grades and test scores?</br>4. Provide an explanation of your transcript record. Is there anything on your transcript that you would like to share more information about with the committee?</br></br><b><i>Please enter your essay in the space provided or upload using the button below.</i></b></br></br>','','False','False','Essay 1','','Upload Essay 1(UGFR)','','','','012DS00000AdtxiYAB','','','','','','','','','ReqItemUuid-40d74da0-af55-46f2-807f-765829139e15','','','','True','','','Requirement__c-119');
