INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-744','True','False','True','','','','','','','1.0','True','True','','','','','','','','','Submitting an essay is a chance to write directly to the committee reviewing your application and it gives you a chance to help us get to know you better. Essays demonstrate your ability to write clearly and concisely on a selected topic and distinguish yourself in your own voice. <i>Essays are recommended, but not required. </i> </br></br>
<b>Essay 2 Topic:</b></br></br>
It is important to St. Thomas that all members of our community understand our dedication to providing an inclusive living and learning environment. <i>We would like to hear your observations and thoughts about diversity and inclusion based on what you have learned in your lifetime.</i></br></br>
<b><i>Please enter your essay in the space provided or upload it using the button below.</i></b></br></br>','','False','False','Essay 2','','Upload Essay 2 (UGTR)','','','','012DS00000AdtxiYAB','','','','','','','','','ReqItemUuid-248addde-ca82-4d22-863b-0c6402096531','','','','True','','','Requirement__c-43');
INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-745','True','False','True','','','','','','','0.0','True','True','','','','','','','','','Submitting an essay is a chance to write directly to the committee reviewing your application and it gives you a chance to help us get to know you better. Essays demonstrate your ability to write clearly and concisely on a selected topic and distinguish yourself in your own voice. <i><b>Essays are recommended, but not required. </b></i> </br></br>

You may choose one of the topics described below or submit a paper you have written for class.  </br></br>

<b>Essay 1 Topics:</b></br></br>

1. Discuss a meaningful contribution you have made through involvement in school, church or community activities.</br>

2. Describe an event, a person or an educational experience that has had a major impact on your life and why.</br>

3. Share additional information about your personal story that would be beneficial to the application review process. What do you want the readers to know about you apart from courses, grades and test scores?</br>

4. Provide an explanation of your transcript record. Is there anything on your transcript that you would like to share more information about with the committee?</br></br>

<b><i>Please enter your essay in the space provided or upload using the button below.</i></b>

</br></br>','','False','False','Essay 1','','Upload Essay 1 (UGTR)','','','','012DS00000AdtxiYAB','','','','','','','','','ReqItemUuid-7550fbb7-901c-479d-a964-a92ec136a19d','','','','True','','','Requirement__c-43');
