INSERT INTO "Requirement_Item__c" VALUES('Requirement_Item__c-816','True','False','False','','Started App','','','','','','True','True','Started App','','','','','','','','<center><b><Font size=4 Font color=#6d3696>Personal Statement</b></Font><Font color=Red>*</Font></center>



<br>



<br>



The personal essay statement section includes three questions. Please take your time to think through and write responses to these questions in (1-2) pages, double-spaced. Your responses will be used to assess your experiences and attributes in relationship to becoming a nursing student at the University of St. Thomas.



<br>

<br>



(1) Describe a challenging situation that required ingenuity or creativity to serve someone in need. How did you demonstrate resilience and a willingness to learn through the challenge?



<br>

<br>



(2) Describe a situation where you served someone whose culture or worldview differed from yours. How did you educate yourself? How did this interaction help you understand this person''s beliefs and values as well as yours? How may this influence your interactions as a future nurse?



<br>

<br>



(3) The School of Nursing''s mission calls for graduates to partner with others in providing ethical care focused on the whole person (mind, body, and spirit) and whole community. Describe a situation where you worked collaboratively to demonstrate ethical decision-making to address inequity and promote social justice.



<br>



<br>



File must be a MS Word (.doc or .docx), Rich Text Format (.rtf), Text (.txt) or PDF (.pdf) document, and not exceed 4 MB. Please be advised, PDF file format uploads are strongly recommended as other file formats may be altered during the upload process.','','False','False','Personal Statement','','Essays  (GSON)','','','','012DS00000AdtxiYAB','','','','','','','','Started App','ReqItemUuid-52a13b07-148a-48d9-a413-3a35538246a8','','','','True','','','Requirement__c-154');
